	('3c95672e-dfec-4876-aeeb-cc15c21f3319', 'Anaerobic Sludge Digesters', 'Anaerobic bacteria digest sludge producing biogas.', 'cd5b5840-2554-4c99-a2dc-acab108f3801', 154, '2026-01-03 18:00:43.005202+00', '2026-01-03 18:00:43.005202+00'),
	('02579d76-4124-4242-b623-af89c2f47061', 'Saturation Property', 'Each nucleon interacts only with nearest neighbours.', '41ddc4dd-5616-47d1-95a1-74aef737a6b6', 313, '2026-01-03 18:00:43.619629+00', '2026-01-03 18:00:43.619629+00'),
	('7a91e905-843c-4b06-aeda-748f048f48b1', 'Adoption', 'Legal adoption as alternative to parenthood.', 'd571a6d6-1fc7-498a-abfe-e43a05f21cc5', 48, '2026-01-03 18:00:44.264854+00', '2026-01-03 18:00:44.264854+00'),
	('1e3c3c9e-ec0f-4e84-9082-da328cb0ba2c', 'Rate Law', 'Rate law expresses reaction rate in terms of reactant concentrations raised to powers determined experimentally.', 'f8716c62-8a28-4df0-af11-b6a92194a7af', 7, '2026-01-03 18:00:44.875663+00', '2026-01-03 18:00:44.875663+00'),
	('c395bddc-1a10-4790-982a-246ec03b7b43', 'Cyclotron Frequency', 'Frequency ν = q B / (2π m), independent of speed.', '61bc56c1-1982-46c6-a2eb-c9093de98e65', 112, '2026-01-03 18:00:45.5221+00', '2026-01-03 18:00:45.5221+00'),
	('b116c7d1-cde1-4b8c-ba0e-b3bf4e9c7ce3', 'Objective Function', 'A linear function Z = ax + by which is to be maximised or minimised is called the objective function.', '8f56fb81-4c79-465f-83cb-fa7c0244e868', 396, '2026-01-03 18:00:46.156678+00', '2026-01-03 18:00:46.156678+00'),
	('b836d357-f60b-420e-9a69-723d54e29381', 'Electromotive Force', 'EMF is potential difference between terminals of a cell in open circuit.', '391d1298-6c06-4a93-a168-d53e5370d7e8', 94, '2026-01-03 18:00:46.802023+00', '2026-01-03 18:00:46.802023+00'),
	('b8e04e2c-8826-4810-891a-402c89497d92', 'Alkalis', 'Bases that dissolve in water are called alkalis.', 'c404e084-b1cb-43df-b7a5-08a956ce7382', 24, '2026-01-03 18:00:47.430188+00', '2026-01-03 18:00:47.430188+00'),
	('6da54990-5694-497b-a539-3c5f3eac4c67', 'Isobars', 'Nuclides having same mass number A.', '8eaf292b-ffee-43e7-abc0-243be343548e', 309, '2026-01-03 18:00:48.086325+00', '2026-01-03 18:00:48.086325+00'),
	('8422fef5-6fad-4c29-ab70-262ead878e05', 'Derivative of cos⁻¹x', 'The derivative of cos⁻¹x is −1/√(1−x²) for x in (−1,1).', 'a02369ed-ea82-400e-a000-ac2b34aaaf98', 124, '2026-01-03 18:00:48.718034+00', '2026-01-03 18:00:48.718034+00'),
	('6635563a-ef14-433d-a56d-ba4b1f18d274', 'Collision Frequency', 'Number of collisions per second per unit volume.', '7abd2cca-6d6d-4431-80b2-b726c92bd173', 23, '2026-01-03 18:00:49.355698+00', '2026-01-03 18:00:49.355698+00'),
	('5ab3c423-e72c-450a-8b96-0794b2710fad', 'Restriction for cosine to be invertible', 'If the domain of cosine function is restricted to [0, π], then it becomes one-one and onto with range [−1, 1], so its inverse can be defined.', 'b0feafe0-9b94-49e6-a8da-f6ffa97f9838', 20, '2026-01-03 18:00:50.001919+00', '2026-01-03 18:00:50.001919+00'),
	('1adf6608-16ec-436f-b006-fb16fea23692', 'Grouped Data', 'Large sets of data are organised into class intervals with corresponding frequencies, called grouped data.', '255b2130-4f35-4cd0-a95d-b52cc2ac273d', 171, '2026-01-03 18:00:52.043135+00', '2026-01-03 18:00:52.043135+00'),
	('0a60c0cf-22a6-473f-95cc-a3276761149c', 'Radius of Curvature', 'The radius of the sphere of which the mirror forms a part is called the radius of curvature.', '6bbe32b4-93e0-455f-974d-69413fea13de', 136, '2026-01-03 18:00:54.288631+00', '2026-01-03 18:00:54.288631+00'),
	('93d3027f-e81d-4ab6-8d73-5a61f22490bd', 'Products', 'New substances formed during a chemical reaction are called products.', 'eff4d1b6-20bb-4df0-8260-e0bf8677691c', 2, '2026-01-03 18:00:54.937242+00', '2026-01-03 18:00:54.937242+00'),
	('0d61e253-a233-4793-9b00-f88dd4c3216a', 'Advance Sunrise and Delayed Sunset', 'Atmospheric refraction causes the Sun to be visible before actual sunrise and after actual sunset.', 'fc713eda-0b89-4af4-89b8-f9d80c1e6c42', 168, '2026-01-03 18:00:35.897394+00', '2026-01-03 18:00:35.897394+00'),
	('b0ee657d-8e7b-47e4-af7d-2316268d1063', 'Male Reproductive System', 'The male reproductive system produces and delivers sperms.', 'e1993049-3f19-4d7f-8bb7-025b2363d9ff', 123, '2026-01-03 18:00:38.293055+00', '2026-01-03 18:00:38.293055+00'),
	('1a246c6f-04be-4909-bd77-c8199262bcf9', 'Principal value branch of sec⁻¹', 'sec⁻¹ is taken as the function with domain R − (−1, 1) and range [0, π] − {π/2}; written as sec⁻¹ : R − (−1, 1) → [0, π] − {π/2}.', '74771c59-f321-44f5-9afc-f6d9ecf90cf0', 23, '2026-01-03 18:00:39.720274+00', '2026-01-03 18:00:39.720274+00'),
	('6fba7912-8393-48f6-be26-cb517007d4fa', 'Increasing Function', 'A function f is increasing on an interval if x1 < x2 implies f(x1) < f(x2) for all x1, x2 in the interval.', 'c71bfafc-1530-4d3b-9d86-4ac677493895', 152, '2026-01-03 18:00:40.363082+00', '2026-01-03 18:00:40.363082+00'),
	('95f4ebeb-f675-40a4-b815-a1d6e557506e', 'Capacitive Reactance', 'XC = 1 / (ωC).', 'af957215-be46-4c5b-a3a3-fe6ce8830191', 184, '2026-01-03 18:00:40.936561+00', '2026-01-03 18:00:40.936561+00'),
	('f0682445-6f26-4d43-becd-b34f90ea9b7a', 'Continuous Charge Distribution', 'Potential is obtained by integrating contributions from charge elements.', '52497817-e782-47de-bdd7-b18890f8605a', 52, '2026-01-03 18:00:41.529811+00', '2026-01-03 18:00:41.529811+00'),
	('032b79aa-8931-44bc-9a38-348468d6b3e0', 'Hydronium Ion Formation', 'Hydrogen ions combine with water molecules to form hydronium ions (H₃O⁺).', 'c404e084-b1cb-43df-b7a5-08a956ce7382', 23, '2026-01-03 18:00:42.119501+00', '2026-01-03 18:00:42.119501+00'),
	('35045ce5-6033-4454-9704-2493b15e80c1', 'Alternative Measures of Density', 'Population density may be measured as biomass, percent cover or relative density.', '18a8ae89-2031-4e57-9bad-a65827acdab4', 192, '2026-01-03 18:00:42.702153+00', '2026-01-03 18:00:42.702153+00'),
	('683ca910-c976-4e9b-9db8-cfc2c0d52668', 'Crystal Field Splitting Energy', 'Energy difference between t2g and eg levels.', '40926115-10ad-490e-9ef5-5ce9c8584bbb', 133, '2026-01-03 18:00:43.317348+00', '2026-01-03 18:00:43.317348+00'),
	('ffb0e0d6-b9ef-4215-8b26-8a9142b03fa5', 'Iodine Lustre', 'Iodine is a non-metal that shows metallic lustre.', 'bebf07d0-d44f-4fa8-836d-4bfe2c1f064b', 40, '2026-01-03 18:00:43.938753+00', '2026-01-03 18:00:43.938753+00'),
	('e4f9d01a-af6e-4157-bbf2-9fa9525c5e3b', 'Energy Flow in Ecosystem', 'Energy flows from producers to consumers and decomposers in an ecosystem.', 'c0564f41-46ac-481e-b6ac-0bf7c3a9c5ca', 210, '2026-01-03 18:00:44.565556+00', '2026-01-03 18:00:44.565556+00'),
	('21e35f72-34d0-4af6-9bbb-d537f4b12c20', 'Electric Power', 'Electric power P = IV.', 'eaf692ed-ba58-4084-8629-60666f501e83', 92, '2026-01-03 18:00:45.179112+00', '2026-01-03 18:00:45.179112+00'),
	('913c1ce5-405e-45dd-b255-8151ffa70baf', 'Proof by Contradiction', 'Proof by contradiction establishes a statement by assuming its negation and arriving at a contradiction.', '3951b360-ed0d-456c-8bd2-a0c91fb3d600', 234, '2026-01-03 18:00:45.822471+00', '2026-01-03 18:00:45.822471+00'),
	('43c20abe-aa3b-4c40-bd8f-19ada60db24a', 'Aperture of Mirror', 'The diameter of the reflecting surface of a spherical mirror is called its aperture.', '6bbe32b4-93e0-455f-974d-69413fea13de', 137, '2026-01-03 18:00:46.465391+00', '2026-01-03 18:00:46.465391+00'),
	('15f45f1a-147f-4ba8-9f40-ecbec190cd0a', 'Empty Nature of Atom', 'The nucleus occupies about 10^-12 of atomic volume but contains more than 99.9% of atomic mass.', '4fad2c79-f3d8-4b2b-aac8-586766690cc2', 306, '2026-01-03 18:00:47.121938+00', '2026-01-03 18:00:47.121938+00'),
	('baabc512-6aae-4755-9535-88c736319553', 'Life Processes', 'The processes that together perform the maintenance functions of living organisms are called life processes.', '9cd2fb66-53bb-48cb-b12d-b2ec2b079260', 80, '2026-01-03 18:00:47.764887+00', '2026-01-03 18:00:47.764887+00'),
	('1f44007f-3b19-4683-8fa8-6271997318f2', 'Fuel Cell', 'Galvanic cell converting fuel energy directly into electricity.', '06d57db5-93fa-45aa-8bfc-d41d20e98519', 26, '2026-01-03 18:00:48.390801+00', '2026-01-03 18:00:48.390801+00'),
	('c983d9af-fd6a-45b4-ba6e-e12128ff8c70', 'Magnifying Power of Microscope', 'm = 1 + D/f or D/f depending on image position.', '2a74be9f-b16a-437b-b871-07324393fa74', 242, '2026-01-03 18:00:49.026743+00', '2026-01-03 18:00:49.026743+00'),
	('df1b0602-a6fe-4f16-8db4-7727a3379482', 'Biopiracy', 'Unauthorised use of biological resources without compensation.', 'b7fc7a7d-4d4d-47ad-924f-abece347aee3', 185, '2026-01-03 18:00:49.677491+00', '2026-01-03 18:00:49.677491+00'),
	('556efda8-d9ef-4db2-a7e1-98d2c93f454a', 'Malaria', 'Malaria is caused by Plasmodium species transmitted by female Anopheles mosquito.', 'b414de79-b18e-4fa6-88c1-46675f006a3a', 131, '2026-01-03 18:00:50.901807+00', '2026-01-03 18:00:50.901807+00'),
	('77165001-2183-41dd-98ef-526a60ba1d5e', 'Amino Acids', 'α-Amino acids contain both amino and carboxyl groups.', '24e86792-1bf3-42f1-aadd-9d02791b2a41', 290, '2026-01-03 18:00:53.310305+00', '2026-01-03 18:00:53.310305+00'),
	('59c77405-478d-4198-9010-376a13b86c64', 'Carbylamine Reaction', 'Primary amines form isocyanides with chloroform and KOH.', '538e13e6-79d2-4ea7-93d7-20300172228e', 273, '2026-01-03 18:00:54.613717+00', '2026-01-03 18:00:54.613717+00'),
	('e8a6e594-62a5-4172-aa29-b89a6f890d52', 'Electric Current in Conductors', 'Electric current in conductors is due to motion of free electrons under an electric field.', '841a66fa-542c-4267-81c6-e5db15c71a39', 83, '2026-01-03 18:00:55.274348+00', '2026-01-03 18:00:55.274348+00'),
	('b409257a-c75b-495f-8dad-b28d326830cd', 'Principal Focus', 'Principal focus is point where paraxial rays converge or appear to diverge.', 'a025a8a2-d3b1-4ce3-a35f-6d92be1b5e43', 224, '2026-01-03 18:06:34.19549+00', '2026-01-03 18:06:34.19549+00')
INSERT INTO "public"."concepts" ("id", "name", "description", "topic_id", "page_number", "created_at", "updated_at") VALUES
	('019c2804-6171-7d8e-b72b-f783e9d084b0', 'Greatest 5-digit number', 'The largest number with five digits, which is 99999.', '019c2804-6170-7397-ae3e-20015e8e8e2f', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6172-7207-b31f-74c4d43c8bc8', 'Smallest 6-digit number', 'Formed by adding 1 to the greatest 5-digit number, resulting in 100000 (one lakh).', '019c2804-6170-7397-ae3e-20015e8e8e2f', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6173-7ca5-9d55-d6ab9c9a9dbd', 'Smallest 7-digit number', 'Formed by adding 1 to the greatest 6-digit number, resulting in 1000000 (ten lakh).', '019c2804-6170-7397-ae3e-20015e8e8e2f', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6174-718a-8fa9-61e383268fe2', 'Smallest 8-digit number', 'Formed by adding 1 to the greatest 7-digit number, resulting in 10000000 (one crore).', '019c2804-6170-7397-ae3e-20015e8e8e2f', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6175-7cde-abb2-93591290e1e2', 'Smallest 9-digit number', 'Formed by adding 1 to the greatest 8-digit number, resulting in 100000000 (ten crore).', '019c2804-6170-7397-ae3e-20015e8e8e2f', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6176-7610-808f-7564ce614259', 'Number conversions', 'Key conversions between standard number units like hundreds, thousands, lakhs, and crores. For example, 1 lakh = 100 thousands.', '019c2804-6170-7397-ae3e-20015e8e8e2f', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6177-7266-9461-a3f353a08518', 'Forming 3-digit numbers', 'Demonstrates how to form all possible 3-digit numbers using given unique digits or digits including zero, by varying digit positions.', '019c2804-6170-7397-ae3e-20015e8e8e2f', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6179-79ba-9a85-78cf0af27470', 'Numeration and Notation', 'Numeration is expressing a number in words, and notation is representing it in digits.', '019c2804-6178-70b6-b8b4-fb6a02945f73', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-617a-7c64-ad9c-a1f3f744e91c', 'Periods in Indian System', 'Numbers are split into groups called periods: ones, thousands, lakhs, crores, and arabs.', '019c2804-6178-70b6-b8b4-fb6a02945f73', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-617b-7eb1-8187-9c37ac2e12bc', 'Ones period places', 'The ones period contains hundreds, tens, and ones places.', '019c2804-6178-70b6-b8b4-fb6a02945f73', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-617c-7ea8-83de-e760e8083262', 'Thousands period places', 'The thousands period contains thousands and ten thousands places.', '019c2804-6178-70b6-b8b4-fb6a02945f73', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-617d-7748-8a27-7fe79ad5a8ea', 'Indian Place Value Chart', 'A chart showing periods (Arabs, Crores, Lakhs, Thousands, Ones/Units) and their corresponding places with values in the Indian system.', '019c2804-6178-70b6-b8b4-fb6a02945f73', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-617e-7de2-ae6f-e933983f4ac5', 'Commas in Indian System', 'Commas separate periods: first after three digits from the right (ones period), then every two digits (thousands, lakhs periods).', '019c2804-6178-70b6-b8b4-fb6a02945f73', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-617f-776a-90cb-61f770ea76d4', 'Vacant place digit', 'In a number, if a place is vacant, then 0 must be placed at that position.', '019c2804-6178-70b6-b8b4-fb6a02945f73', '4', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6181-713f-a60a-4b05cb22c7a9', 'Place Value of a digit', 'The place value of a non-zero digit depends on its position. The place value of digit 0 is always zero.', '019c2804-6180-7f9d-b62a-9bd99d4f8015', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6182-7b4b-8257-463890311a86', 'Face Value of a digit', 'The face value of a digit in any number is the digit itself, regardless of its position in the number.', '019c2804-6180-7f9d-b62a-9bd99d4f8015', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6183-77ee-a920-2c64f220d04d', 'Place Value calculation', 'The place value of a digit is the product of its value and its place in the number.', '019c2804-6180-7f9d-b62a-9bd99d4f8015', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6185-7f71-a310-0914bc9bf09e', 'Definition', 'A number is in expanded notation when written as the sum of the place values of its digits.', '019c2804-6184-7bf6-9f79-612a387c0324', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6186-7ba0-8fae-fd492be711fd', 'Writing in expanded form', 'Illustrates how to break down a number into the sum of its place values, for example, 25027 = 20000 + 5000 + 0 + 20 + 7.', '019c2804-6184-7bf6-9f79-612a387c0324', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6188-75ab-b61e-dadab226b289', 'Periods in International', 'In the International system, numbers are grouped into periods: ones, thousands, millions, and billions.', '019c2804-6187-7c92-aae9-a360d3684679', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6189-7973-b620-db75ae242b03', 'International Place Value', 'A chart showing periods (Billions, Millions, Thousands, Ones) and their corresponding places with values in the International system.', '019c2804-6187-7c92-aae9-a360d3684679', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-618a-71eb-beb8-41971fc73a34', 'Commas in International', 'Commas are used after every three digits from the right in the International system of numeration.', '019c2804-6187-7c92-aae9-a360d3684679', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-618c-731d-ab9d-ea1ffee89dd1', 'Comparison by digits', 'If numbers have an unequal number of digits, the number with more digits is greater.', '019c2804-618b-7780-80b5-cde8086e990c', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-618d-7ed8-b175-e12d947334a5', 'Highest place comparison', 'If numbers have an equal number of digits, compare the digits at the highest (leftmost) place to find the greater number.', '019c2804-618b-7780-80b5-cde8086e990c', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-618e-7ece-b655-fdb1df79d382', 'Step-by-step comparison', 'If leftmost digits are equal, compare the next digits from left to right until an unequal digit is found.', '019c2804-618b-7780-80b5-cde8086e990c', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6190-7671-97fc-f1dbc74a7a16', 'Definition of Successor', 'The successor of a number is 1 more than the given number.', '019c2804-618f-7fd0-9220-95cbd5bd7cf0', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6191-783e-a2b8-f211996a3ce2', 'Definition of Predecessor', 'The predecessor of a number is 1 less than the given number.', '019c2804-618f-7fd0-9220-95cbd5bd7cf0', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6192-7b12-a63e-7aee8e711e67', 'Finding successor/predecessor', 'Examples demonstrating how to calculate the number immediately after or before a given number by adding or subtracting 1.', '019c2804-618f-7fd0-9220-95cbd5bd7cf0', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6194-70a1-afa7-c24054a1ed44', 'Measurement units', 'Introduction to standard units for length (m, cm), mass (kg, g, mg), and capacity (litres, millilitres) and their common uses.', '019c2804-6193-7a8e-a706-0ef32204f417', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6195-74bf-bc21-070f37b10c41', 'Standard unit conversions', 'Basic conversions like 1 metre = 100 centimetres, 1 kilogram = 1000 grams, and 1 litre = 1000 millilitres.', '019c2804-6193-7a8e-a706-0ef32204f417', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6196-7357-9fe0-4fa3eb764dff', 'Prefixes for larger units', 'Using ''deca'', ''hecto'', ''kilo'' before standard units to denote units 10, 100, or 1000 times larger.', '019c2804-6193-7a8e-a706-0ef32204f417', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6197-7962-a34b-e3117066b50e', 'Prefixes for smaller units', 'Using ''deci'', ''centi'', ''milli'' before standard units to denote units one-tenth, one-hundredth, or one-thousandth smaller.', '019c2804-6193-7a8e-a706-0ef32204f417', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6198-7184-b9c6-34c864e3defe', 'Metric System', 'The system of measurement that organizes units of length, mass, and capacity from smallest to largest using specific prefixes and powers of 10.', '019c2804-6193-7a8e-a706-0ef32204f417', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6199-7d5a-8277-da7959fe6758', 'Metric conversion chart', 'A diagram illustrating the relationships and conversion factors (multiplying or dividing by 10) between metric units.', '019c2804-6193-7a8e-a706-0ef32204f417', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-619b-717d-aafd-e8dc55230d43', 'Millimetre to Centimetre', '10 millimetres (mm) = 1 centimetre (cm).', '019c2804-619a-7eb8-9828-b9729dec3573', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-619c-7264-ad7a-378b2d7910e8', 'Centimetre to Decimetre', '10 centimetres (cm) = 1 decimetre (dm).', '019c2804-619a-7eb8-9828-b9729dec3573', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-619d-7d84-a721-a6f7687285d4', 'Decimetre to Metre', '10 decimetres (dm) = 1 metre (m).', '019c2804-619a-7eb8-9828-b9729dec3573', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-619e-7445-b5b3-f2de6db0b013', 'Metre to Decametre', '10 metres (m) = 1 decametre (dam).', '019c2804-619a-7eb8-9828-b9729dec3573', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-619f-7e6f-98b6-3268dbf52b22', 'Decametre to Hectometre', '10 decametres (dam) = 1 hectometre (hm).', '019c2804-619a-7eb8-9828-b9729dec3573', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61a0-76a5-99a6-de2c20ac33f2', 'Hectometre to Kilometre', '10 hectometres (hm) = 1 kilometre (km).', '019c2804-619a-7eb8-9828-b9729dec3573', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61a2-7d6d-b82e-3d8ee9e1cbc6', 'Milligram to Centigram', '10 milligrams (mg) = 1 centigram (cg).', '019c2804-61a1-7eb3-97bd-71c11f9e42d8', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61a3-7f2b-b4d7-a7f6804a37cf', 'Centigram to Decigram', '10 centigrams (cg) = 1 decigram (dg).', '019c2804-61a1-7eb3-97bd-71c11f9e42d8', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61a4-7c0d-aa2f-2fd93ffe4757', 'Decigram to Gram', '10 decigrams (dg) = 1 gram (g).', '019c2804-61a1-7eb3-97bd-71c11f9e42d8', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61a5-7fec-a2d9-d53bcd495140', 'Gram to Decagram', '10 grams (g) = 1 decagram (dag).', '019c2804-61a1-7eb3-97bd-71c11f9e42d8', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61a6-7fd6-ab5e-444a357d3d98', 'Decagram to Hectogram', '10 decagrams (dag) = 1 hectogram (hg).', '019c2804-61a1-7eb3-97bd-71c11f9e42d8', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61a7-7fea-9353-f4c6883e1996', 'Hectogram to Kilogram', '10 hectograms (hg) = 1 kilogram (kg).', '019c2804-61a1-7eb3-97bd-71c11f9e42d8', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61a9-7b7f-9d2a-0d40a323651b', 'Millilitre to Centilitre', '10 millilitres (ml) = 1 centilitre (cl).', '019c2804-61a8-7333-954a-f1122c8e9711', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61aa-79ed-9526-1f81f2fbeef8', 'Centilitre to Decilitre', '10 centilitres (cl) = 1 decilitre (dl).', '019c2804-61a8-7333-954a-f1122c8e9711', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61ab-70b5-a688-a0bcecf5bb37', 'Decilitre to Litre', '10 decilitres (dl) = 1 litre (l).', '019c2804-61a8-7333-954a-f1122c8e9711', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61ac-72fb-bb65-f15a499c76be', 'Litre to Decalitre', '10 litres (l) = 1 decalitre (dal).', '019c2804-61a8-7333-954a-f1122c8e9711', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61ad-70af-af25-e5032c97d41d', 'Decalitre to Hectolitre', '10 decalitres (dal) = 1 hectolitre (hl).', '019c2804-61a8-7333-954a-f1122c8e9711', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61ae-7103-82b8-ccb6839b89f0', 'Hectolitre to Kilolitre', '10 hectolitres (hl) = 1 kilolitre (kl).', '019c2804-61a8-7333-954a-f1122c8e9711', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61b3-74fe-b41e-e8c69a84180d', 'Expanded Form', 'Writing a number as the sum of its digits'' place values.', '019c2804-61af-71cd-ba0a-13b7052a6d98', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61b0-78d9-9b1a-88ab0ff6d9ab', 'Comparing Numbers', 'Rule that numbers with more digits are greater, or compare from the leftmost digit if the number of digits is the same.', '019c2804-61af-71cd-ba0a-13b7052a6d98', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61b1-769c-bd72-8bd42d158a3d', 'Face Value', 'The inherent value of the digit.', '019c2804-61af-71cd-ba0a-13b7052a6d98', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61b2-7b40-8fa9-dfa027b30145', 'Place Value', 'Value determined by a digit''s position in a number.', '019c2804-61af-71cd-ba0a-13b7052a6d98', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61b4-7391-9b59-b572dbc36781', 'Predecessor', 'The number immediately preceding a given number.', '019c2804-61af-71cd-ba0a-13b7052a6d98', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61b5-7c50-abe2-561e516f5627', 'Successor', 'The number immediately following a given number.', '019c2804-61af-71cd-ba0a-13b7052a6d98', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61b6-7204-bef6-a97bdea267d6', 'Ascending Order', 'Arranging numbers from the smallest to the greatest.', '019c2804-61af-71cd-ba0a-13b7052a6d98', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61b7-737e-92a0-e3a0246a0df2', 'Descending Order', 'Arranging numbers from the greatest to the smallest.', '019c2804-61af-71cd-ba0a-13b7052a6d98', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61b8-7e0a-a2cc-b1e0225939c2', 'Indian System Map', 'Overview of Indian Place Value System periods (Arabs, Crores, Lakhs, Thousands, Ones) and their corresponding places.', '019c2804-61af-71cd-ba0a-13b7052a6d98', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61b9-7f64-a43a-b34c670ea669', 'International System Map', 'Overview of International Place Value System periods (Billions, Millions, Thousands, Ones) and their corresponding places.', '019c2804-61af-71cd-ba0a-13b7052a6d98', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61eb-7b0e-8fe0-f111c829e2ab', 'Definition of Line Segment', 'A line segment is a fixed portion of a line with a definite length, used for comparison.', '019c2804-61ea-7e3a-b68a-9254c78932fe', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61ec-7d0f-b923-123e36482891', 'Comparison by Observation', 'The simplest way to compare line segments is by observing their lengths, though it''s difficult for small differences.', '019c2804-61ea-7e3a-b68a-9254c78932fe', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61ed-7d9c-bfb9-cdc17ebabf3c', 'Comparison by Tracing', 'To compare two line segments, one can be traced on paper and placed over the other.', '019c2804-61ea-7e3a-b68a-9254c78932fe', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61ee-7eab-a31f-7f5c681b4ed2', 'Comparing using Divider', 'A divider, with hinged arms, is used to measure the distance of one segment and compare it to another.', '019c2804-61ea-7e3a-b68a-9254c78932fe', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61ef-7ab3-af79-e6e642fc4a56', 'Divider: Equal Segments', 'If the divider''s second point falls on the end of the second segment (Q), then AB = PQ.', '019c2804-61ea-7e3a-b68a-9254c78932fe', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61f0-7792-b3b7-8a1ab9f4ab08', 'Divider: First Segment Shorter', 'If the divider''s second point falls between P and Q, then AB < PQ.', '019c2804-61ea-7e3a-b68a-9254c78932fe', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61f1-763c-b73c-c2b90caa95fb', 'Divider: First Segment Longer', 'If the divider''s second point falls beyond Q, then AB > PQ.', '019c2804-61ea-7e3a-b68a-9254c78932fe', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61f2-7894-aec9-d3f4fc27b715', 'Measuring with Ruler', 'Measuring lengths using a ruler is a precise way to compare line segments. The basic unit is metre (m).', '019c2804-61ea-7e3a-b68a-9254c78932fe', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61f3-711f-b7b6-4ea686af582e', 'Units of Length', 'A metre is divided into 100 centimetres (cm), and a centimetre is divided into 10 millimetres (mm).', '019c2804-61ea-7e3a-b68a-9254c78932fe', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61f4-787f-8525-cb1f69262688', 'Steps to Measure with Ruler', 'Place the zero mark of the ruler at one end (P) of the segment and read the mark at the other end (Q).', '019c2804-61ea-7e3a-b68a-9254c78932fe', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61f5-73ee-89e1-edff21460b10', 'Measuring with Divider', 'To avoid ruler thickness difficulties, a divider can be used to set the segment''s length and then measure it against a ruler.', '019c2804-61ea-7e3a-b68a-9254c78932fe', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61f7-7ec3-8134-446e89bb9f70', 'Angle Definition', 'An angle is a figure formed by two rays sharing a common initial point.', '019c2804-61f6-755f-a7d1-150a0c85e2ae', '4', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61f8-7ba5-a7b2-d12c11fb6f6e', 'Angle by Ray Rotation', 'An angle can also be described by rotating a ray from an initial to a final position around its initial point (vertex).', '019c2804-61f6-755f-a7d1-150a0c85e2ae', '4', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61f9-776c-a6be-d6578c34e4d9', 'Magnitude of Angle', 'The magnitude of an angle is the amount of rotation needed to bring one arm to the position of the other arm around the vertex.', '019c2804-61f6-755f-a7d1-150a0c85e2ae', '4', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61fb-7c45-8870-4c105534ff21', 'Magnitude Dependence', 'The magnitude of an angle depends on the opening between the two rays that form it.', '019c2804-61fa-75c6-a0ca-fbec81f27d22', '4', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61fc-7185-bcf4-943c6c543468', 'Comparison by Observation', 'Angles can be compared by observing their opening; a greater opening means a greater magnitude.', '019c2804-61fa-75c6-a0ca-fbec81f27d22', '4', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61fd-7e78-ab76-925ba53049e1', 'Comparison by Tracing', 'To compare angles, trace one angle onto paper and place it over the other, aligning vertices and one ray.', '019c2804-61fa-75c6-a0ca-fbec81f27d22', '4', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61fe-7906-a6e0-27a9d77bb9c5', 'Tracing: Smaller Angle', 'If the traced ray falls between the rays of the second angle, the first angle is smaller.', '019c2804-61fa-75c6-a0ca-fbec81f27d22', '4', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61ff-7b3b-9352-2cb86aa52f69', 'Tracing: Greater Angle', 'If the traced ray falls beyond the rays of the second angle, the first angle is greater.', '019c2804-61fa-75c6-a0ca-fbec81f27d22', '4', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6200-758c-8925-5dedc029de72', 'Tracing: Equal Angles', 'If the traced ray coincides with the ray of the second angle, then the angles are equal.', '019c2804-61fa-75c6-a0ca-fbec81f27d22', '4', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-620e-7279-bb51-0689415a0682', 'Minute Hand 1/2 Revolution', 'A minute hand moving to 6 makes 1/2 of a revolution, which is a straight angle (180°).', '019c2804-6201-7d0a-b781-c79ef49c4ed5', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6202-7455-8c3a-8c76f23ad9ba', 'Unit of Angle Measurement', 'The degree (°) is the standard unit to measure angles.', '019c2804-6201-7d0a-b781-c79ef49c4ed5', '4', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6203-73b5-9bf0-9883afa17ec2', 'Definition of One Degree', 'A complete revolution divided into 360 equal parts defines one degree (1°).', '019c2804-6201-7d0a-b781-c79ef49c4ed5', '4', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6204-7bf6-b24f-cd542fe894e6', 'Protractor Instrument', 'A protractor, a semicircular instrument divided into 180 equal parts, is used to measure angles.', '019c2804-6201-7d0a-b781-c79ef49c4ed5', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6205-7f7e-a308-d9ef91f0a6c4', 'Protractor Inner Scale', 'The inner scale is marked 0° to 180° anticlockwise for measuring anticlockwise angles.', '019c2804-6201-7d0a-b781-c79ef49c4ed5', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6206-772a-9a7c-1484c08e9901', 'Protractor Outer Scale', 'The outer scale is marked 0° to 180° clockwise for measuring clockwise angles.', '019c2804-6201-7d0a-b781-c79ef49c4ed5', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6207-71fb-9187-d58f5c66c32d', 'Measuring Angle: Step 1', 'Place the protractor''s mid-point (O) on the angle''s vertex (Q).', '019c2804-6201-7d0a-b781-c79ef49c4ed5', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6208-7169-849b-c27f8ba226c0', 'Measuring Angle: Step 2', 'Adjust the protractor so one ray (QP) aligns with its straight edge.', '019c2804-6201-7d0a-b781-c79ef49c4ed5', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6209-7cf1-ad5e-7f3b8a965ff2', 'Measuring Angle: Step 3', 'Read the scale where the 0° mark coincides with the aligned ray.', '019c2804-6201-7d0a-b781-c79ef49c4ed5', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-620a-7e52-be96-a4be1af4e51e', 'Measuring Angle: Step 4', 'The mark indicated by the second ray (QR) on the curved edge gives the angle''s degree measure.', '019c2804-6201-7d0a-b781-c79ef49c4ed5', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-620b-7fcf-80cb-b3c019048fc1', 'Measuring Reflex Angle', 'To find a reflex angle, subtract the given angle''s measure from 360°.', '019c2804-6201-7d0a-b781-c79ef49c4ed5', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-620c-72e5-b911-0c4856849222', 'Sum of Angles at a Point', 'The sum of all angles formed at a single point is always 360°.', '019c2804-6201-7d0a-b781-c79ef49c4ed5', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-620d-7381-91d7-8aa40e9db6cf', 'Minute Hand 1/4 Revolution', 'A minute hand moving from 12 to 3 makes 1/4 of a revolution, which is a right angle (90°).', '019c2804-6201-7d0a-b781-c79ef49c4ed5', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-620f-7c23-a681-30cb13dfce4f', 'Minute Hand 3/4 Revolution', 'A minute hand moving to 9 makes 3/4 of a revolution, which is 3 right angles (270°).', '019c2804-6201-7d0a-b781-c79ef49c4ed5', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6210-79de-b790-cd67ad5aa1e3', 'Hour Hand Full Revolution', 'The hour hand completes one revolution (360°) in 12 hours.', '019c2804-6201-7d0a-b781-c79ef49c4ed5', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6212-78b9-b518-cb7852abf20e', 'Zero Angle', 'An angle where the initial and final positions of the ray are the same, measuring zero degrees.', '019c2804-6211-7651-ab46-8e6bc6b7e804', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6213-7c6f-8db7-f9e71af53ad3', 'Acute Angle', 'An angle measuring greater than 0° but less than 90°.', '019c2804-6211-7651-ab46-8e6bc6b7e804', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6214-7097-a3b9-97320f265e24', 'Right Angle', 'An angle measuring exactly 90°, often formed by a ray rotating from horizontal to vertical.', '019c2804-6211-7651-ab46-8e6bc6b7e804', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6215-7a28-889f-4a7a06e81cf1', 'Obtuse Angle', 'An angle measuring greater than 90° but less than 180°.', '019c2804-6211-7651-ab46-8e6bc6b7e804', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6216-7b14-a73a-601ce578ebdd', 'Straight Angle', 'An angle measuring exactly 180°, formed when the initial and final ray positions are opposite.', '019c2804-6211-7651-ab46-8e6bc6b7e804', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6217-76ae-98f2-390b95706167', 'Reflex Angle', 'An angle measuring greater than 180° but less than 360°.', '019c2804-6211-7651-ab46-8e6bc6b7e804', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6218-713a-b1e9-9624da60a4d2', 'Complete Angle', 'An angle measuring exactly 360°, formed when a rotating ray returns to its initial position after a full revolution.', '019c2804-6211-7651-ab46-8e6bc6b7e804', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6219-7e6e-8b4c-e80eaf1bd2e9', 'Straight Angle and Right Angles', '1 straight angle is equal to 2 right angles, which is 180°.', '019c2804-6211-7651-ab46-8e6bc6b7e804', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-621a-7506-88af-87d3bde38471', 'Complete Angle and Right Angles', '1 complete angle is equal to 4 right angles, which is 360°.', '019c2804-6211-7651-ab46-8e6bc6b7e804', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-621b-7f9c-b3c8-4345d72038b5', 'Complete Angle and Straight Angles', '1 complete angle is equal to 2 straight angles, which is 360°.', '019c2804-6211-7651-ab46-8e6bc6b7e804', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-621d-7e06-b536-e2fe4c90e2c8', 'Definition of Perpendicular', 'Two lines are perpendicular if they intersect each other at an angle of 90°.', '019c2804-621c-7efa-b62f-d06e6bf7684f', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-621e-7ae9-8932-28a5ddad2aaa', 'Perpendicular Notation', 'If line AB is perpendicular to line CD, it is written as AB ⊥ CD.', '019c2804-621c-7efa-b62f-d06e6bf7684f', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-621f-7108-a5df-ab4a17a9a97f', 'Real-world Perpendiculars', 'Examples include walls perpendicular to the floor and a pole perpendicular to the ground.', '019c2804-621c-7efa-b62f-d06e6bf7684f', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6221-7680-8d29-63c9e50f2d9c', 'Definition of Bisector', 'A line segment''s perpendicular bisector passes through its mid-point and is perpendicular to it.', '019c2804-6220-7d9f-aed0-603701aa36c9', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6222-7396-9712-0d863aa9fba6', 'Unique Perpendicular Bisector', 'Every line segment has a unique perpendicular bisector because it has a unique mid-point.', '019c2804-6220-7d9f-aed0-603701aa36c9', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6224-772e-876e-4bcd6f2c636a', 'Definition of Triangle', 'A triangle is a polygon with the least number of sides, specifically three sides.', '019c2804-6223-7c76-9026-416136d2b629', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6226-7a6c-9706-9ecf45405919', 'Scalene Triangle', 'A triangle with all three sides of different lengths is called a scalene triangle.', '019c2804-6225-75d2-b205-56c2197632aa', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6227-7dea-b1db-5c2e03f84abd', 'Isosceles Triangle', 'A triangle with any two sides of equal length is called an isosceles triangle.', '019c2804-6225-75d2-b205-56c2197632aa', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6228-7771-80b7-0a1e30fbf21c', 'Equilateral Triangle', 'A triangle with all three sides of equal length is called an equilateral triangle.', '019c2804-6225-75d2-b205-56c2197632aa', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6229-7736-ba71-a77b929b9017', 'Triangle Inequality Property', 'The sum of the lengths of any two sides of a triangle is always greater than the length of the third side.', '019c2804-6225-75d2-b205-56c2197632aa', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-622a-786e-8292-3f9af24e2e77', 'Equiangular Triangle', 'A triangle where all three angles are equal is called an equiangular triangle, which is also an equilateral triangle.', '019c2804-6225-75d2-b205-56c2197632aa', '11', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-622c-7dd9-9aec-1dc9d79e2411', 'Acute Angled Triangle', 'A triangle in which all angles are acute (less than 90°) is an acute angled triangle.', '019c2804-622b-7261-bd04-6f0621fbfe8b', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-622d-7b8d-8e04-0f19c797ccae', 'Right Angled Triangle', 'A triangle with one angle measuring exactly 90° is a right angled triangle.', '019c2804-622b-7261-bd04-6f0621fbfe8b', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-622e-788f-8c24-96cf5079d546', 'Obtuse Angled Triangle', 'A triangle with one angle measuring greater than 90° is an obtuse angled triangle.', '019c2804-622b-7261-bd04-6f0621fbfe8b', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-622f-732a-b300-48c982472300', 'Sum of Angles in Triangle', 'The sum of the angles of a triangle is always 2 right angles, which equals 180°.', '019c2804-622b-7261-bd04-6f0621fbfe8b', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6231-715c-a9ea-5a3c58e9ac74', 'Definition of Quadrilateral', 'A quadrilateral is a polygon that has exactly four sides.', '019c2804-6230-77f2-b996-e33977d5514d', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6232-7127-9a78-257aedb6f70f', 'Sum of Quadrilateral Angles', 'The sum of the interior angles of a quadrilateral is 4 right angles, which equals 360°.', '019c2804-6230-77f2-b996-e33977d5514d', '14', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6234-7ee5-9cfa-461908f083d7', 'Definition of Parallelogram', 'A quadrilateral in which both pairs of opposite sides are parallel is called a parallelogram.', '019c2804-6233-7afa-9b76-b18bc6937ea7', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6235-74fc-987b-545964fb3580', 'Opposite Sides Property', 'In a parallelogram, opposite sides are parallel and equal in length.', '019c2804-6233-7afa-9b76-b18bc6937ea7', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6236-7781-ac76-e8f6d710d2e1', 'Opposite Angles Property', 'In a parallelogram, opposite angles are equal in measure.', '019c2804-6233-7afa-9b76-b18bc6937ea7', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6237-7c77-a647-62d67a815d26', 'Diagonals Bisect Property', 'In a parallelogram, the diagonals bisect each other.', '019c2804-6233-7afa-9b76-b18bc6937ea7', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6239-754b-a530-0b197e9329f0', 'Definition of Rectangle', 'A rectangle is a parallelogram where each interior angle measures 90°.', '019c2804-6238-76af-ad7e-397b4f78072c', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-623a-7822-84dc-2443806710bb', 'Properties from Parallelogram', 'Since a rectangle is a parallelogram, it possesses all the properties of a parallelogram.', '019c2804-6238-76af-ad7e-397b4f78072c', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-623b-739f-bf3c-8accf9749f40', 'Angles of Rectangle', 'In a rectangle, each of its four angles measures 90°.', '019c2804-6238-76af-ad7e-397b4f78072c', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-623c-79f4-9338-51e3fb4b1163', 'Diagonals of Rectangle', 'In a rectangle, the diagonals are equal in length.', '019c2804-6238-76af-ad7e-397b4f78072c', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-623e-70ae-8283-f778f4f39bd0', 'Definition of Rhombus', 'A rhombus is a parallelogram in which all four sides are equal in length.', '019c2804-623d-7f79-a5e5-458c56f1eca8', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-623f-71a0-9391-df87ec39a910', 'Properties from Parallelogram', 'As a parallelogram, a rhombus has all the properties of a parallelogram.', '019c2804-623d-7f79-a5e5-458c56f1eca8', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6240-70ab-bd09-811755038717', 'Sides of Rhombus', 'In a rhombus, all its sides (AB, BC, CD, DA) are equal.', '019c2804-623d-7f79-a5e5-458c56f1eca8', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6241-7efb-8709-196489dc1ce4', 'Diagonals of Rhombus', 'In a rhombus, the diagonals bisect each other at right angles.', '019c2804-623d-7f79-a5e5-458c56f1eca8', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6246-7a76-b828-96746b658152', 'Sides of Square', 'In a square, all its sides (AB, BC, CD, DA) are equal in length.', '019c2804-6242-7d96-8d95-b89704d06194', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6243-7fb6-aae7-a5bc8854162b', 'Definition as Rectangle', 'A square is a rectangle with all four sides being equal in length.', '019c2804-6242-7d96-8d95-b89704d06194', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6244-70d4-99ff-9205b397fb2f', 'Definition as Rhombus', 'A square is also a rhombus where each angle measures 90°.', '019c2804-6242-7d96-8d95-b89704d06194', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6245-7af4-9a4c-d240417c69e9', 'Combined Properties', 'A square possesses all the properties of both a rectangle and a rhombus.', '019c2804-6242-7d96-8d95-b89704d06194', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6247-7796-978f-319c1a8cf189', 'Angles of Square', 'In a square, each of its four angles measures 90°.', '019c2804-6242-7d96-8d95-b89704d06194', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6248-7215-9f47-b3e0156a9311', 'Diagonals of Square: Equal', 'In a square, the diagonals are equal in length.', '019c2804-6242-7d96-8d95-b89704d06194', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6249-7375-b96d-358b9d40972d', 'Diagonals of Square: Bisect Perpendicularly', 'In a square, the diagonals bisect each other at right angles.', '019c2804-6242-7d96-8d95-b89704d06194', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-624b-71cc-9b49-6391fd560df9', 'Definition of Trapezium', 'A trapezium is a quadrilateral that has at least one pair of opposite sides parallel.', '019c2804-624a-77d4-9abd-5a3accffcf9e', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-624c-78ee-83e8-31b0d1cb07f2', 'Isosceles Trapezium', 'If a trapezium''s non-parallel sides are equal, it is called an isosceles trapezium.', '019c2804-624a-77d4-9abd-5a3accffcf9e', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-624d-78a7-af47-511115ab1b51', 'Properties of Isosceles Trapezium', 'An isosceles trapezium has parallel sides, equal non-parallel sides, equal adjacent angles (two pairs), and equal diagonals.', '019c2804-624a-77d4-9abd-5a3accffcf9e', '14', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-624f-78c1-8770-1065e632c97a', 'Definition of Kite', 'A quadrilateral is a kite if it has two distinct pairs of equal adjacent sides.', '019c2804-624e-7a4c-b227-209b2ce02d02', '14', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6250-73ff-b9ef-e19f6f7443da', 'Diagonals of Kite', 'In a kite, its diagonals intersect each other at right angles.', '019c2804-624e-7a4c-b227-209b2ce02d02', '14', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6251-73ec-b29d-f7e4b201eded', 'Adjacent Sides of Kite', 'In a kite, two pairs of adjacent sides (AB=BC, AD=CD) are equal.', '019c2804-624e-7a4c-b227-209b2ce02d02', '14', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6252-75cd-9736-00665de00ee8', 'Diagonals Bisection in Kite', 'In a kite, one diagonal is perpendicularly bisected by the other diagonal.', '019c2804-624e-7a4c-b227-209b2ce02d02', '14', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6254-760c-8ccc-1ee08a6e13e4', 'Definition of Polygon', 'A polygon is a closed figure that is made up entirely of straight line segments.', '019c2804-6253-7ae0-911e-ed571aebb7dd', '14', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6255-7404-8506-cea3989dc6fe', 'Examples of Polygons', 'Triangles (3 sides) and quadrilaterals (4 sides) are common examples of polygons.', '019c2804-6253-7ae0-911e-ed571aebb7dd', '14', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6256-7cd0-8d35-0477fc33a31d', 'Regular Polygon', 'A regular polygon is one where all its sides are equal in length and all its angles are equal.', '019c2804-6253-7ae0-911e-ed571aebb7dd', '14', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6257-7d26-a241-176c2377c676', 'Irregular Polygon', 'An irregular polygon is any polygon that does not have all equal sides and all equal angles.', '019c2804-6253-7ae0-911e-ed571aebb7dd', '14', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6258-73b0-8c62-4034f54e889c', 'Pentagon', 'A polygon with five sides is known as a pentagon.', '019c2804-6253-7ae0-911e-ed571aebb7dd', '15', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6259-7167-884c-61209461957b', 'Hexagon', 'A polygon with six sides is known as a hexagon.', '019c2804-6253-7ae0-911e-ed571aebb7dd', '15', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-625a-78d0-992d-a78634b4ef79', 'Heptagon', 'A polygon with seven sides is known as a heptagon.', '019c2804-6253-7ae0-911e-ed571aebb7dd', '15', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-625b-74ab-a6f4-bc1101cd7114', 'Octagon', 'A polygon with eight sides is known as an octagon.', '019c2804-6253-7ae0-911e-ed571aebb7dd', '15', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-625c-7599-ab9a-45a3a6d92544', 'Nonagon', 'A polygon with nine sides is known as a nonagon.', '019c2804-6253-7ae0-911e-ed571aebb7dd', '15', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-625e-774e-8e44-918c1dcadcee', 'Three-Dimensional World', 'Our world is three-dimensional, meaning objects have length, breadth, and height.', '019c2804-625d-7494-ab41-dee4bd892315', '16', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-625f-7e4b-8f18-27a335481492', 'Definition of 3D Shapes', 'Shapes measurable in three directions are called three-dimensional or solid shapes.', '019c2804-625d-7494-ab41-dee4bd892315', '16', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6260-79e1-a395-f01a8f9e3094', 'Examples of Solid Shapes', 'Common examples include cuboid, cube, cylinder, sphere, cone, prism, and pyramid.', '019c2804-625d-7494-ab41-dee4bd892315', '16', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6261-7fe7-8544-b13448a6c520', 'Elements of Solid Shapes', 'Faces, edges, and vertices are the fundamental elements that describe solid shapes.', '019c2804-625d-7494-ab41-dee4bd892315', '16', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6263-7ea5-9aa4-4bc1dd6664b8', 'Definition of Cuboid', 'A cuboid is a three-dimensional shape bounded by six rectangular faces.', '019c2804-6262-723c-a3af-9d9a5c12c0b0', '16', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6264-74d3-9455-a6455a3f0e28', 'Faces of a Cuboid', 'Each flat surface of a cuboid is called a face; a cuboid has 6 faces.', '019c2804-6262-723c-a3af-9d9a5c12c0b0', '16', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6265-7f7a-a7ef-b1d052aab995', 'Opposite Faces', 'In a cuboid, faces that do not share an edge are opposite faces, e.g., top and bottom.', '019c2804-6262-723c-a3af-9d9a5c12c0b0', '16', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6266-7020-9b49-29ec3ada3089', 'Adjacent Faces', 'Any two faces of a cuboid that are not opposite are considered adjacent faces.', '019c2804-6262-723c-a3af-9d9a5c12c0b0', '16', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6267-7835-881e-68b36b35340a', 'Edges of a Cuboid', 'Two faces meet at a line segment called an edge; a cuboid has 12 edges.', '019c2804-6262-723c-a3af-9d9a5c12c0b0', '16', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6268-7c8b-bf75-11aedb751307', 'Vertices of a Cuboid', 'Three edges meet at a point called a vertex; a cuboid has 8 vertices.', '019c2804-6262-723c-a3af-9d9a5c12c0b0', '16', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-626a-74b9-86f0-d39cc19134d9', 'Definition of Cube', 'A cube is a special cuboid where its length, breadth, and height are all equal.', '019c2804-6269-7cc5-9569-e7d0631bee4f', '16', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-626b-709f-aaec-d7226fb074d3', 'Properties of Cube', 'A cube has 6 square faces, 12 edges (each called a side), and 8 vertices.', '019c2804-6269-7cc5-9569-e7d0631bee4f', '16', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-626d-7a88-8a7b-31652db11579', 'Definition of Cylinder', 'A cylinder is a solid bounded by two flat circular surfaces and one curved surface.', '019c2804-626c-791d-84d5-17192311fd21', '16', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-626e-7a38-bd63-8b89bb354215', 'Cylinder Vertices and Edges', 'A cylinder has no vertices but possesses two circular edges.', '019c2804-626c-791d-84d5-17192311fd21', '16', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-626f-76a9-8ca6-07c2ed04af68', 'Height of Cylinder', 'The distance between the two flat circular faces is referred to as its length or height.', '019c2804-626c-791d-84d5-17192311fd21', '16', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6270-7c89-a185-4e063c960f26', 'Radius of Cylinder', 'The radius of the circular face is known as the radius of the cylinder''s base.', '019c2804-626c-791d-84d5-17192311fd21', '16', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6271-78af-88c8-0cdafd7d676e', 'Lateral Surface of Cylinder', 'The curved surface that joins the two bases of a cylinder is called its lateral surface.', '019c2804-626c-791d-84d5-17192311fd21', '16', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6273-7ffb-9bed-416ba9dec7d8', 'Definition of Sphere', 'A sphere is a solid shape without edges and vertices, characterized by a single curved surface.', '019c2804-6272-76fa-aabe-c5c105c392a0', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6274-7e1d-8ae3-73dcc127bf5b', 'Fixed Point Property', 'Every point on the curved surface of a sphere is equidistant from a fixed central point.', '019c2804-6272-76fa-aabe-c5c105c392a0', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6275-7724-91ac-4cfb93bb0d85', 'Centre of Sphere', 'The fixed central point within a sphere is called its centre.', '019c2804-6272-76fa-aabe-c5c105c392a0', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6276-74e5-893b-de495c693d21', 'Radius of Sphere', 'The fixed distance from the centre to any point on the curved surface is called the radius.', '019c2804-6272-76fa-aabe-c5c105c392a0', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6277-73b0-b7b9-28123cc0e860', 'Diameter of Sphere', 'A diameter is a line segment passing through the centre of a sphere with both endpoints on the sphere.', '019c2804-6272-76fa-aabe-c5c105c392a0', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6278-73e2-ac75-a1667870b4c5', 'Diameter-Radius Relation', 'The diameter of a sphere is exactly twice its radius (Diameter = 2 × radius).', '019c2804-6272-76fa-aabe-c5c105c392a0', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-627a-7314-b560-a411a8c55c15', 'Definition of Cone', 'A cone is a solid with one flat circular face (base), one vertex, and one curved surface.', '019c2804-6279-725f-bdf0-d53577287612', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-627b-78d3-8ba7-6a4a88b21e22', 'Height of Cone', 'The height of a cone is the length of the line segment from its vertex to the centre of its base.', '019c2804-6279-725f-bdf0-d53577287612', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-627c-7c5c-a3b0-14f0d97b8052', 'Slant Height of Cone', 'The slant height is the length of the line segment from the vertex to any point on the circular edge of the base.', '019c2804-6279-725f-bdf0-d53577287612', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-627d-725a-b520-14a9e571c0d5', 'Radius of Cone', 'The radius of the circular base is known as the radius of the base of the cone.', '019c2804-6279-725f-bdf0-d53577287612', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-627f-7f87-8c38-344ab05d8331', 'Definition of Prism', 'A prism is a solid with two identical, parallel rectilinear figure ends and parallelogram/rectangular side faces.', '019c2804-627e-7fce-89d2-ebdef420bb0f', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6280-7333-adf5-d6b16a4bce42', 'Naming of Prism', 'A prism is named based on the shape of its base.', '019c2804-627e-7fce-89d2-ebdef420bb0f', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6281-7f94-9d05-3abfb8da4640', 'Triangular Prism', 'A prism with identical triangular bases is called a triangular prism.', '019c2804-627e-7fce-89d2-ebdef420bb0f', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6282-75c3-9be0-ac03d58e161c', 'Triangular Prism Properties', 'A triangular prism has 5 faces (3 rectangular, 2 triangular), 9 edges, and 6 vertices.', '019c2804-627e-7fce-89d2-ebdef420bb0f', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6283-793d-a29b-b7185784857d', 'Square Prism', 'A prism with identical square bases is called a square prism; a cube is an example.', '019c2804-627e-7fce-89d2-ebdef420bb0f', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6284-70a4-90c7-76a390235091', 'Square Prism Properties', 'A square prism has 6 faces, 12 edges, and 8 vertices.', '019c2804-627e-7fce-89d2-ebdef420bb0f', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6285-7c94-99f0-c937496feeee', 'Rectangular Prism (Cuboid)', 'A cuboid is also known as a rectangular prism.', '019c2804-627e-7fce-89d2-ebdef420bb0f', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6287-723e-84e4-290aa4a6d366', 'Definition of Pyramid', 'A pyramid is a solid with a rectilinear base and triangular side faces meeting at a common vertex.', '019c2804-6286-7f7a-a151-79af364df6bc', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6288-753e-b664-5d16ea59084d', 'Height of Pyramid', 'The height is the perpendicular length from the pyramid''s vertex to its base.', '019c2804-6286-7f7a-a151-79af364df6bc', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6289-721b-bc08-61abd738ff33', 'Lateral Faces of Pyramid', 'The side faces of a pyramid, which are triangular, are called its lateral faces.', '019c2804-6286-7f7a-a151-79af364df6bc', '18', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-628a-7adf-b2ef-54f2de09ea35', 'Triangular Pyramid', 'A pyramid with a triangular base is a triangular pyramid, also known as a tetrahedron.', '019c2804-6286-7f7a-a151-79af364df6bc', '18', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-628b-7e41-ac6e-987747c25b7e', 'Tetrahedron Description', '''Tetra'' means four and ''hedron'' means faces, hence tetrahedron implies 4 faces.', '019c2804-6286-7f7a-a151-79af364df6bc', '18', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-628c-7913-b796-b8f3bc458481', 'Triangular Pyramid Properties', 'A triangular pyramid has 4 faces, 4 vertices, and 6 edges.', '019c2804-6286-7f7a-a151-79af364df6bc', '18', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-628d-748a-a2e0-4af541e2e0e1', 'Square Pyramid', 'A pyramid with a square base is called a square pyramid.', '019c2804-6286-7f7a-a151-79af364df6bc', '18', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-628e-73a7-af1f-475dde79b60f', 'Square Pyramid Properties', 'A square pyramid has 5 faces (4 triangular, 1 square), 5 vertices, and 8 edges.', '019c2804-6286-7f7a-a151-79af364df6bc', '18', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-613b-7da5-a040-8d25802da592', 'Symmetry in Nature', 'Symmetry is found everywhere in nature and is an important theme in art, architecture and design.', '019c2804-613a-7e05-aeb1-fe6ace535e29', '185', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-613c-7ff4-8796-9101c7fe4e87', 'Examples of Symmetry', 'Architectural marvels like Taj Mahal and India Gate are beautiful because of their symmetry. Butterfly wings, plants, animals, and human faces also show symmetry.', '019c2804-613a-7e05-aeb1-fe6ace535e29', '185', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-613d-7059-b168-386ed4b8276e', 'Symmetrical Figures', 'Figures with evenly balanced proportions are called symmetrical. This property is known as symmetry.', '019c2804-613a-7e05-aeb1-fe6ace535e29', '185', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-613f-74a2-88e8-18c3de7e7e91', 'Concept of Line of Symmetry', 'A sheet of paper folded into two halves with punched holes demonstrates symmetry about the fold.', '019c2804-613e-7302-bd25-0795f4f4aeca', '185', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6140-70b0-a7ea-7a2b493f324c', 'Definition of Symmetrical Figure', 'A symmetrical figure is one that has a line of symmetry.', '019c2804-613e-7302-bd25-0795f4f4aeca', '185', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6141-7564-9cb8-b0c0bcefd67f', 'Definition of Line of Symmetry', 'A line that divides a given figure into two identical halves is called the line of symmetry or axis of symmetry.', '019c2804-613e-7302-bd25-0795f4f4aeca', '185', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6142-7c71-9e81-dbe45bd95774', 'Mirror Image Property', 'The word ''symmetry'' means an object can be divided into two equal parts such that one part coincides with the other, each being a mirror image.', '019c2804-613e-7302-bd25-0795f4f4aeca', '186', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6143-7e61-aa6f-49275e505c43', 'Vertical Line of Symmetry', 'A vertical line of symmetry divides a figure into two identical parts vertically.', '019c2804-613e-7302-bd25-0795f4f4aeca', '186', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6144-7d15-b208-8432a1299b13', 'Horizontal Line of Symmetry', 'A horizontal line of symmetry divides a figure into two identical parts horizontally.', '019c2804-613e-7302-bd25-0795f4f4aeca', '186', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6145-77ee-bd02-682b4f13d516', 'Asymmetrical Figures', 'A figure that cannot be divided into two equal halves by any line is said to be asymmetrical.', '019c2804-613e-7302-bd25-0795f4f4aeca', '186', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6146-79e0-b911-a33b352372ab', 'Identifying Lines of Symmetry', 'Example demonstrates how to find the number of lines of symmetry in various figures.', '019c2804-613e-7302-bd25-0795f4f4aeca', '186', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6147-78a6-8f08-6fae3380c475', 'Completing Symmetrical Figures', 'Example shows how to complete figures by drawing the other identical half using a dotted line as the line of symmetry.', '019c2804-613e-7302-bd25-0795f4f4aeca', '186', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6149-75c1-963b-615f5c8c3213', 'Line Segment Symmetry', 'A line segment is symmetrical about its perpendicular bisector.', '019c2804-6148-7d39-8828-b3f94d11f123', '188', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-614a-7937-b0cf-dd99394e074b', 'Angle Symmetry', 'An angle with equal arms is symmetrical about its bisector ray.', '019c2804-6148-7d39-8828-b3f94d11f123', '188', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-614b-767d-809a-0ccae664ca7d', 'Isosceles Triangle Symmetry', 'An isosceles triangle is symmetrical about the bisector of the angle included between its two equal sides.', '019c2804-6148-7d39-8828-b3f94d11f123', '188', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-614c-784e-8b15-aa639e7c2229', 'Equilateral Triangle Symmetry', 'An equilateral triangle is symmetrical about each bisector of its interior angles and has three lines of symmetry.', '019c2804-6148-7d39-8828-b3f94d11f123', '188', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-614d-75f0-8af1-687ea6528a73', 'Rectangle Symmetry', 'A rectangle has two lines of symmetry, each joining the mid-points of opposite sides.', '019c2804-6148-7d39-8828-b3f94d11f123', '188', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-614e-738e-8b3e-3785fba58f92', 'Rectangle Diagonals and Symmetry', 'A rectangle is not symmetrical about any of its diagonals.', '019c2804-6148-7d39-8828-b3f94d11f123', '188', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-614f-7f91-8c28-64783bce82ce', 'Square Symmetry', 'A square has four lines of symmetry, including two diagonals and lines joining the mid-points of opposite sides.', '019c2804-6148-7d39-8828-b3f94d11f123', '188', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6150-7c2a-aa53-b9a7f82d7dbd', 'Rhombus Symmetry', 'A rhombus is symmetrical about each of its diagonals and has two lines of symmetry.', '019c2804-6148-7d39-8828-b3f94d11f123', '189', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6151-7ca1-987e-04ee9fbea5be', 'Kite Symmetry', 'A kite has one line of symmetry, which is its longer diagonal.', '019c2804-6148-7d39-8828-b3f94d11f123', '189', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6152-7bd4-9df6-432d589b99af', 'Circle Symmetry', 'A circle is symmetrical about each of its diameters and has an infinite number of lines of symmetry.', '019c2804-6148-7d39-8828-b3f94d11f123', '189', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6153-7419-aaff-979723013a0f', 'Semicircle Symmetry', 'A semicircle has one line of symmetry, which is the perpendicular bisector of the line joining its end points.', '019c2804-6148-7d39-8828-b3f94d11f123', '189', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6154-784c-b6ca-223656eea83f', 'Regular Pentagon Symmetry', 'A regular pentagon has five lines of symmetry, which are perpendiculars from its vertices to respective opposite sides.', '019c2804-6148-7d39-8828-b3f94d11f123', '189', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6155-701d-a313-adc64092242c', 'Regular Hexagon Symmetry', 'A regular hexagon has six lines of symmetry, three along lines joining mid-points of opposite sides and three along diagonals.', '019c2804-6148-7d39-8828-b3f94d11f123', '189', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6156-78d3-b65d-4fc07853cd93', 'Regular Polygon Symmetry Rule', 'A regular polygon with ''n'' sides has ''n'' lines of symmetry.', '019c2804-6148-7d39-8828-b3f94d11f123', '189', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6157-75f1-bbcd-8c30591c63f2', 'Irregular Polygon Symmetry', 'Irregular polygons can also have lines of symmetry, but not as many as the number of sides.', '019c2804-6148-7d39-8828-b3f94d11f123', '189', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6159-7417-9689-6557a20b2980', 'Symmetrical English Letters', 'Several English alphabet letters are symmetrical about dotted lines, including A, B, C, D, E, H, I, K, M, O, T, U, V, W, X, Y.', '019c2804-6158-774f-89d1-9bca8d49e4ad', '190', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-615b-7d3a-a387-aff9d641e61b', 'Reflection and Symmetry Relation', 'Mirror reflection and the line of symmetry are naturally related and linked to each other.', '019c2804-615a-7b38-b8d9-0aebdf1da617', '191', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-615c-7613-8812-dadb4187f20a', 'Real-world Reflections', 'Examples like trees and mountains reflected in water, and one''s own reflection in a mirror, demonstrate reflection.', '019c2804-615a-7b38-b8d9-0aebdf1da617', '191', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-615d-719e-9464-366d957bdfb4', 'Properties of Reflection', 'Reflections about a line preserve length and angle. The lengths and angles of the object and its image are the same.', '019c2804-615a-7b38-b8d9-0aebdf1da617', '191', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-615e-75d0-87ed-13b60b5566a5', 'Orientation in Reflection', 'Reflection reverses orientation.', '019c2804-615a-7b38-b8d9-0aebdf1da617', '191', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-615f-7207-85f2-4573c12d96de', 'Line of Reflection as Line of Symmetry', 'The line of reflection is called the line of symmetry. If paper is folded, the mirror line becomes the line of symmetry.', '019c2804-615a-7b38-b8d9-0aebdf1da617', '191', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6160-78c7-bcfb-57ca94f5a5bd', 'Image and Mirror Line', 'The image formed is a reflection of the object in the mirror line.', '019c2804-615a-7b38-b8d9-0aebdf1da617', '191', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6161-75bd-9e13-c12edcae899c', 'Mirror Line as Perpendicular Bisector', 'The mirror line is always the perpendicular bisector of lines joining corresponding points in the original figure and its image.', '019c2804-615a-7b38-b8d9-0aebdf1da617', '191', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6162-7879-9bc7-ba3102db0c46', 'Completing Figures with Two Lines of Symmetry', 'Example shows how to complete drawings on squared paper using two dotted lines as lines of symmetry, first vertically and then horizontally or vice-versa.', '019c2804-615a-7b38-b8d9-0aebdf1da617', '191', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6164-7eaa-a839-f18a0bf61258', 'Definition of Line of Symmetry (Map)', 'A line drawn dividing a figure into two identical parts is called the line of symmetry.', '019c2804-6163-7c65-9a1f-0a8b5a9db89c', '193', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6165-7037-8c91-2c2db051138a', 'One Line of Symmetry Figures', 'Figures with one line of symmetry include isosceles triangle, line segment, kite, and semicircle.', '019c2804-6163-7c65-9a1f-0a8b5a9db89c', '193', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6166-78c7-84c3-89e8f1f9bf02', 'Two Lines of Symmetry Figures', 'Figures with two lines of symmetry include rectangle and rhombus.', '019c2804-6163-7c65-9a1f-0a8b5a9db89c', '193', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6167-7a74-b5ab-d5f52ee5a255', 'Three Lines of Symmetry Figures', 'Figures with three lines of symmetry include equilateral triangle.', '019c2804-6163-7c65-9a1f-0a8b5a9db89c', '193', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6168-7582-aded-71f38d56dea0', 'Four Lines of Symmetry Figures', 'Figures with four lines of symmetry include square.', '019c2804-6163-7c65-9a1f-0a8b5a9db89c', '193', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6169-7b5c-bcc0-574054fbc82b', 'Infinitely Many Lines of Symmetry Figures', 'Figures with infinitely many lines of symmetry include circle.', '019c2804-6163-7c65-9a1f-0a8b5a9db89c', '193', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-616a-7322-a77c-ebbeb585f813', 'Regular Polygon Lines of Symmetry', 'A regular polygon has as many lines of symmetry as the number of its sides.', '019c2804-6163-7c65-9a1f-0a8b5a9db89c', '193', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-616c-7ef8-a0fb-9e1b4189a679', 'Definition of Fractals', 'Fractals are never-ending, infinitely complex, self-similar patterns created by repeating a simple process.', '019c2804-616b-75cf-b7b3-16a6e09b5978', '195', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-616d-7248-89c3-8fe511874ac9', 'Geometric Nature of Fractals', 'Geometrically, fractals exist in between our familiar dimensions.', '019c2804-616b-75cf-b7b3-16a6e09b5978', '195', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-616e-774e-a62a-a563aa4604a5', 'Fractals in Nature', 'Fractal patterns are extremely familiar and found in nature, such as trees, rivers, coastlines, mountains, clouds, seashells, and hurricanes.', '019c2804-616b-75cf-b7b3-16a6e09b5978', '195', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
