	('019c2804-60a8-7714-b553-4dd005b250c1', 'Definition of Perimeter', 'The perimeter of a plane shape is defined as the distance around the shape.', '019c2804-60a7-79de-86a8-665a37f90198', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60a9-7c47-a08e-5ec59b893301', 'Perimeter of a closed figure', 'The perimeter of a closed figure is the length of its boundary, or the length of the outline of a figure.', '019c2804-60a7-79de-86a8-665a37f90198', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60aa-707f-80bb-784157450da1', 'Unit of Perimeter', 'The unit of perimeter is same as that of length.', '019c2804-60a7-79de-86a8-665a37f90198', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60ab-7fdf-b2ad-6fe357d51cda', 'Example of Perimeter (Garden)', 'Walking around a garden, the distance covered would be the garden''s perimeter.', '019c2804-60a7-79de-86a8-665a37f90198', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60ac-745b-9925-c4cf9c1329f0', 'Example of Perimeter (Painting)', 'The length of string wrapped around a painting would be the perimeter of the painting.', '019c2804-60a7-79de-86a8-665a37f90198', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60ad-79be-8b10-dfdbbfc725e7', 'Finding Perimeter of Irregular Figures', 'Example 1 demonstrates how to find the perimeter of given irregular shapes by summing the lengths of their sides.', '019c2804-60a7-79de-86a8-665a37f90198', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60ae-7a28-945f-33548f219927', 'Perimeter of a Rectangle Formula', 'The perimeter of a rectangle with length ''l'' and breadth ''b'' is given by 2 × (length + breadth).', '019c2804-60a7-79de-86a8-665a37f90198', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60af-7183-a83e-cb189e629d03', 'Application of Perimeter (Athlete''s rounds)', 'Example 2 calculates the total distance covered by an athlete running multiple rounds around a rectangular park.', '019c2804-60a7-79de-86a8-665a37f90198', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60b1-7dd7-b059-28649a02df0d', 'Perimeter of a Square', 'For a square of side ''l'', the perimeter is 4 × length of a side (4l).', '019c2804-60b0-7b57-8e30-059585d40d51', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60b2-7525-92f9-f3476ad497aa', 'Perimeter of an Equilateral Triangle', 'An equilateral triangle has all sides of the same length. Its perimeter is 3 × length of a side (3PQ).', '019c2804-60b0-7b57-8e30-059585d40d51', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60b3-7958-9544-8f3869681a5d', 'Perimeter of a Regular Pentagon', 'A regular pentagon has five equal sides; its perimeter is 5 × length of one side.', '019c2804-60b0-7b57-8e30-059585d40d51', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60b4-7cef-bd6c-8bf9fd4490a6', 'Perimeter of a Regular Hexagon', 'A regular hexagon has six equal sides; its perimeter is 6 × length of one side.', '019c2804-60b0-7b57-8e30-059585d40d51', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60b5-7baa-9d20-28635ed78f05', 'General Perimeter of Regular Polygon', 'The perimeter of a regular polygon is calculated as the Number of sides × length of one side.', '019c2804-60b0-7b57-8e30-059585d40d51', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60b7-74b8-87ce-eb64c8d7cc25', 'Examples of Shapes with Same Perimeter', 'Illustrates a square, a rectangle, and a triangle, each with a perimeter of 100 cm, showing different shapes can have the same perimeter.', '019c2804-60b6-7350-936c-96f92220e37c', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60b8-71c9-b17d-cfe5ba4fc3da', 'Finding Unknown Side Given Same Perimeter', 'Example 9 shows how to find the breadth of a rectangle if its perimeter is the same as a given square.', '019c2804-60b6-7350-936c-96f92220e37c', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60ba-72a3-8110-15f22376b566', 'Definition of Area (Region Enclosed)', 'A plane figure with its interior is called the region enclosed by the plane figure. The measurement of this region is called the area.', '019c2804-60b9-786d-b69d-a054d5d031c6', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60bb-7c39-afc6-ca877cee402f', 'Area as Surface Enclosed', 'The amount of surface enclosed by a plane figure is called its area.', '019c2804-60b9-786d-b69d-a054d5d031c6', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60bc-7919-8e9b-f5832d1a6ad0', 'Area as Number of Unit Squares', 'The area of a shape is defined as the number of unit squares that cover a closed figure.', '019c2804-60b9-786d-b69d-a054d5d031c6', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60bd-7273-887c-09353d26dbc9', 'Unit of Area', 'The standard unit of area is square centimetre (sq. cm) or square metre (sq. m). A square with side 1 cm has an area of 1 sq. cm.', '019c2804-60b9-786d-b69d-a054d5d031c6', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60be-7699-80f4-8974fa29c799', 'Finding Approximate Area using Graph Paper', 'Explains how a graph paper, divided into 1 sq. cm squares, can be used to find the approximate area of closed figures.', '019c2804-60b9-786d-b69d-a054d5d031c6', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60bf-709a-ae59-1a70d4e35e8e', 'Rule for Complete Squares', 'The area of one complete square is taken as 1 sq. cm when estimating area on a graph paper.', '019c2804-60b9-786d-b69d-a054d5d031c6', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60c0-70ff-9e3e-90872fc88b90', 'Rule for Portions Less Than Half', 'Portions of the area that are less than half a square are ignored when estimating area.', '019c2804-60b9-786d-b69d-a054d5d031c6', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60c1-7436-bf2c-2f20ec356b62', 'Rule for Portions More Than Half', 'If more than half of a square is in a region, it is counted as one square when estimating area.', '019c2804-60b9-786d-b69d-a054d5d031c6', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60c2-7b3a-a007-e26161367a25', 'Rule for Exactly Half Squares', 'If exactly half of a square is covered, its area is taken as 1/2 sq. cm.', '019c2804-60b9-786d-b69d-a054d5d031c6', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60c3-773f-b814-e4b4e0d3f6d6', 'Example: Area Estimation Table 1', 'Provides an example table showing how to estimate the area of a figure by counting fully filled, half filled, more than half, and less than half squares.', '019c2804-60b9-786d-b69d-a054d5d031c6', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60c4-76ab-a255-80ca1d495dc0', 'Example: Area Estimation Table 2', 'Provides another example table for area estimation.', '019c2804-60b9-786d-b69d-a054d5d031c6', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60c6-7067-a25f-42952d4dca27', 'Area of a Rectangle Formula', 'The area of a rectangle is calculated by multiplying its length and breadth (Area = length × breadth).', '019c2804-60c5-7ee2-8803-a1b72b10f9b9', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60c7-792b-87f9-1c7b6685d833', 'Deriving Length from Area', 'The length of a rectangle can be derived from its area (A) and breadth (b) as length = Area / breadth.', '019c2804-60c5-7ee2-8803-a1b72b10f9b9', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60c8-71c5-9da9-8c231f5ce1b5', 'Deriving Breadth from Area', 'The breadth of a rectangle can be derived from its area (A) and length (l) as breadth = Area / length.', '019c2804-60c5-7ee2-8803-a1b72b10f9b9', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60ca-74a7-95c6-aeb210dad713', 'Square as a Special Rectangle', 'A square is a rectangle whose length and breadth are equal.', '019c2804-60c9-78fd-91d2-4d222936f58a', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60cb-7324-b5c2-92eb88301257', 'Area of a Square Formula', 'The area of a square is calculated by multiplying its side by itself (Area = side × side).', '019c2804-60c9-78fd-91d2-4d222936f58a', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60cd-7b7a-af43-02b1cc3be140', 'Difference in Concept Definition', 'Area measures the surface of an object, while perimeter refers to the boundary that surrounds a closed figure.', '019c2804-60cc-7140-9dbe-a3f1f0d8fd27', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60ce-79bc-b525-a4f94b5b12c3', 'Difference in Units', 'Area is measured in square units (sq. cm, sq. m), while perimeter is measured in linear units (cm, m).', '019c2804-60cc-7140-9dbe-a3f1f0d8fd27', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60cf-7aac-adc8-2f65479f2808', 'Difference in Dimensions', 'Perimeter is one-dimensional (involving only length), while area is two-dimensional (involving length and breadth).', '019c2804-60cc-7140-9dbe-a3f1f0d8fd27', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60d0-75ef-87b1-9400df03f653', 'Calculation of Area of Rectangle (Example 10)', 'Example 10 illustrates how to find the area of a rectangle given its sides, including unit conversions.', '019c2804-60cc-7140-9dbe-a3f1f0d8fd27', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60d1-7197-a8dc-f3c8d94fa960', 'Calculation of Area of Square (Example 11)', 'Example 11 shows how to find the area of a square given its side length, including decimal values.', '019c2804-60cc-7140-9dbe-a3f1f0d8fd27', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60d2-7ff2-a2db-fdf53f0dbb90', 'Finding Uncarpeted Area (Example 12)', 'Example 12 demonstrates how to calculate the area of a floor not covered by a carpet by subtracting the carpet''s area from the floor''s total area.', '019c2804-60cc-7140-9dbe-a3f1f0d8fd27', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60d3-7b59-aba8-31de41f9be0e', 'Finding Perimeter from Area and Side (Example 13)', 'Example 13 explains how to find the perimeter of a rectangle when its area and one side are known.', '019c2804-60cc-7140-9dbe-a3f1f0d8fd27', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60d4-7c92-96f5-66732024993f', 'Finding Area by Splitting Figures (Example 14)', 'Example 14 shows how to find the area of irregular figures by splitting them into simpler rectangles and summing their individual areas.', '019c2804-60cc-7140-9dbe-a3f1f0d8fd27', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60d5-7917-95a6-c52ce968fd09', 'Effect of Halving Side on Square Area', 'If the side of a square is halved, its area becomes one-fourth of the original area.', '019c2804-60cc-7140-9dbe-a3f1f0d8fd27', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60d6-71b4-88a0-aef019405d40', 'Effect of Doubling Side on Square Area', 'If the side of a square is doubled, its area becomes four times the original area.', '019c2804-60cc-7140-9dbe-a3f1f0d8fd27', '11', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60d7-7291-a35a-9230cf5b31d3', 'Calculating Number of Tiles Needed (Example 16)', 'Example 16 illustrates how to determine the number of tiles required to cover a rectangular region by dividing the region''s area by the area of a single tile.', '019c2804-60cc-7140-9dbe-a3f1f0d8fd27', '11', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60da-7002-bc7c-f05fbdae24b1', 'Statistics Definition', 'The branch of mathematics, that deals with the collection, presentation, analysis and interpretation of the numerical data.', '019c2804-60d9-7d6f-80b7-0fbccadb28ef', '226', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60db-7782-95bf-87c68460b265', 'Data Definition', 'Information in the form of numerical figures.', '019c2804-60d9-7d6f-80b7-0fbccadb28ef', '226', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60dc-7b81-8003-0a349f2d0624', 'Observation Definition', 'Each numerical figure in the given data.', '019c2804-60d9-7d6f-80b7-0fbccadb28ef', '226', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60dd-7c7f-8af2-af4d5fdb482b', 'Raw Data', 'Data collected randomly and presented in an unorganized form.', '019c2804-60d9-7d6f-80b7-0fbccadb28ef', '226', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60de-7a93-aadc-bcc1b38a8422', 'Example of Raw Data', 'An unorganised list of marks obtained by students.', '019c2804-60d9-7d6f-80b7-0fbccadb28ef', '226', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60df-71cd-8f28-392aaf4182c0', 'Arrayed Data', 'Raw data when written in ascending or descending order.', '019c2804-60d9-7d6f-80b7-0fbccadb28ef', '226', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60e1-7e3e-b2ab-5e4c4a462cdc', 'Need for Organization', 'Arranging raw data makes it easier to interpret and analyze.', '019c2804-60e0-7633-8b75-07c8ddff94cd', '226', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60e2-7183-a08a-d0a53ab439d5', 'Tally Marks Table Structure', 'Making a table with three columns: Marks, Tally marks, and No. of students (frequency).', '019c2804-60e0-7633-8b75-07c8ddff94cd', '226', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60e3-7fc6-8daf-9b435acb22e6', 'Tally Marks Usage', 'Method of recording observations, where vertical lines represent counts and a cross-line completes a group of five.', '019c2804-60e0-7633-8b75-07c8ddff94cd', '226', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60e4-76de-adbd-bc46c0d310f8', 'Frequency Definition', 'The number of times a particular observation occurs in the given data.', '019c2804-60e0-7633-8b75-07c8ddff94cd', '226', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60e5-7eb2-9c7b-17119b55157c', 'Frequency Distribution', 'A way of presenting data, typically in tabular form, showing how often each value occurs.', '019c2804-60e0-7633-8b75-07c8ddff94cd', '227', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60e6-76fe-89f6-81e7da7f837f', 'Total of Frequencies', 'The sum of all frequencies in a distribution equals the total number of observations.', '019c2804-60e0-7633-8b75-07c8ddff94cd', '227', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60e7-7a1c-adfa-e2d94b386a06', 'Example: Bike Colours', 'Preparing a frequency distribution table for various bike colours of students.', '019c2804-60e0-7633-8b75-07c8ddff94cd', '227', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60e8-7b82-b822-003cfcd08a41', 'Example: Die Throws', 'Preparing a frequency distribution table for numbers obtained from throwing a die multiple times.', '019c2804-60e0-7633-8b75-07c8ddff94cd', '227', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60e9-7073-b911-ef1455ff3334', 'Example: Student Ages', 'Preparing a frequency distribution table for the ages of students in a class.', '019c2804-60e0-7633-8b75-07c8ddff94cd', '227', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60ea-7f95-9657-b03586f5bf56', 'Example: Game Choices', 'Preparing a frequency distribution table for the choices of games among students.', '019c2804-60e0-7633-8b75-07c8ddff94cd', '228', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60ec-740f-bb32-10b066a38d01', 'Pictograph Definition', 'Represents data through pictures of objects.', '019c2804-60eb-7ed8-8fbb-c35854357e6d', '229', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60ed-7543-9850-6c6145f3177e', 'Visual Aid of Pictograph', 'The picture visually helps to understand and analyze the data.', '019c2804-60eb-7ed8-8fbb-c35854357e6d', '229', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60ee-79a0-bd86-4702c645574c', 'Pictograph Components', 'Every pictograph has a title and a key.', '019c2804-60eb-7ed8-8fbb-c35854357e6d', '229', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60ef-73ad-a2b2-13d26565e288', 'Symbol Representation', 'One symbol in a pictograph can represent one item or many items.', '019c2804-60eb-7ed8-8fbb-c35854357e6d', '229', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60f0-7960-9e78-03085a346d17', 'Consistent Symbol Value', 'Within a pictograph, the chosen symbol always has the same value.', '019c2804-60eb-7ed8-8fbb-c35854357e6d', '229', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60f1-7a81-990d-84f9e7760ff9', 'Fractional Symbols', 'Sometimes a fractional part of the symbol is used to represent partial values.', '019c2804-60eb-7ed8-8fbb-c35854357e6d', '229', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60f3-7ffc-a0e4-dacb52057a08', 'Example: Absentees', 'Interpreting a pictograph showing the number of absentees in a class over a week.', '019c2804-60f2-7054-b590-0ff582e34681', '230', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60f4-758e-b9fd-cedc24d59c92', 'Example: Popular Subjects', 'Interpreting a pictograph showing the popularity of different subjects among students.', '019c2804-60f2-7054-b590-0ff582e34681', '230', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60f6-7f4d-b49e-715e9c812ace', 'Steps to Construct', 'A five-step process including creating a table, listing data, choosing a symbol with a key, drawing pictures, and adding a title.', '019c2804-60f5-7e88-85d2-6f4b56dca0ae', '231', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60f7-7ad2-8ba0-7b709f12b60b', 'Example: Animals in Villages', 'Constructing a pictograph to represent the total number of animals in five different villages.', '019c2804-60f5-7e88-85d2-6f4b56dca0ae', '231', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60f8-77dd-b365-4fe8d67a655f', 'Example: Desks in Classes', 'Constructing a pictograph for the number of desks available in different classes (V to IX).', '019c2804-60f5-7e88-85d2-6f4b56dca0ae', '232', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60f9-70ec-a076-aef5069259ba', 'Example: Modes of Transport', 'Constructing a pictograph for various modes of transport used by students to travel to school.', '019c2804-60f5-7e88-85d2-6f4b56dca0ae', '232', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60fb-70aa-83e1-282ab49e6503', 'Statistics Definition', 'The branch of mathematics that deals with the collection, presentation, analysis and interpretation of data.', '019c2804-60fa-78c3-afae-0978f5a64cfd', '226', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60fc-7176-9e7b-a346bfc426d3', 'Observation Definition', 'Each numerical figure in the data is called observation.', '019c2804-60fa-78c3-afae-0978f5a64cfd', '226', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60fd-7d61-bb68-c4dd00d6f236', 'Raw Data Definition', 'The data collected randomly and presented is called the raw data.', '019c2804-60fa-78c3-afae-0978f5a64cfd', '226', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60fe-7259-91ca-c711d4651253', 'Arrayed Data Definition', 'The raw data when written in ascending (or descending) order is called an arrayed data.', '019c2804-60fa-78c3-afae-0978f5a64cfd', '226', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60ff-70be-8c28-955924ee9e02', 'Frequency Definition', 'The number of times a particular observation occurs in the data is called its frequency.', '019c2804-60fa-78c3-afae-0978f5a64cfd', '226', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6100-7666-b515-a4ebc4b9f410', 'Frequency Distribution Table', 'Data arranged in tabular form using tally marks.', '019c2804-60fa-78c3-afae-0978f5a64cfd', '234', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6101-7ab8-899f-bb960dd1be01', 'Pictograph Definition', 'A pictograph represents data through pictures of objects.', '019c2804-60fa-78c3-afae-0978f5a64cfd', '229', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5ffb-74d1-8662-ac98285b3460', 'Natural Numbers Definition', 'Counting numbers (1, 2, 3, ...) are called natural numbers.', '019c2804-5ffa-7980-9021-979e55a2ccf5', '22', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5ffc-78d4-bd4f-5eedaf43a850', 'Smallest Natural Number', '1 is the first and smallest natural number.', '019c2804-5ffa-7980-9021-979e55a2ccf5', '22', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5ffd-7725-9f01-0943c87e81d9', 'Countless Natural Numbers', 'There is no last or greatest natural number; they are countless.', '019c2804-5ffa-7980-9021-979e55a2ccf5', '22', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5ffe-72de-bcf0-320c26e02465', 'Successor of Natural Number', 'Adding 1 to a natural number gives its successor.', '019c2804-5ffa-7980-9021-979e55a2ccf5', '22', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5fff-739f-9f7a-f00695de3e78', 'Predecessor of Natural Number', 'Subtracting 1 from a natural number gives its predecessor.', '019c2804-5ffa-7980-9021-979e55a2ccf5', '22', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6000-7051-898a-5d340e9393c5', 'Whole Numbers Definition', 'The collection of natural numbers along with 0 forms whole numbers (0, 1, 2, 3, ...).', '019c2804-5ffa-7980-9021-979e55a2ccf5', '22', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6001-7a36-9708-48f0f9948390', 'Smallest Whole Number', '0 is the first and smallest whole number.', '019c2804-5ffa-7980-9021-979e55a2ccf5', '22', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6002-734a-8f1f-655c45f99370', 'Natural Numbers as Whole Numbers', 'All natural numbers are whole numbers.', '019c2804-5ffa-7980-9021-979e55a2ccf5', '22', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6003-709c-a5e1-8839bb710ecd', 'Countless Whole Numbers', 'There is no last or greatest whole number; they are countless.', '019c2804-5ffa-7980-9021-979e55a2ccf5', '22', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6004-77b2-91f0-6d039ac359e4', 'Invention of Zero', 'The symbol 0 was invented by the Indian Mathematician Brahmagupta.', '019c2804-5ffa-7980-9021-979e55a2ccf5', '22', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6005-75d4-a2a1-70f992d45226', 'Successor of Whole Number', 'Adding 1 to a whole number gives its successor.', '019c2804-5ffa-7980-9021-979e55a2ccf5', '22', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6006-746f-8c1d-04e7c792e961', 'Predecessor of Whole Number', 'Subtracting 1 from a whole number gives its predecessor.', '019c2804-5ffa-7980-9021-979e55a2ccf5', '22', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6008-714f-9ff4-087eb2236167', 'Representing Whole Numbers on Number Line', 'Draw a line and mark points 0, 1, 2, 3, ... at equal intervals to represent whole numbers.', '019c2804-6007-7706-8232-46ec8973d0c8', '22', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6009-747a-a682-c9296c6cd717', 'Number Line Property 1', 'There is no whole number to the left of ''0'', and every number to its right is greater.', '019c2804-6007-7706-8232-46ec8973d0c8', '22', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-600a-7992-8883-e78b86c96b61', 'Number Line Property 2', 'Every whole number on the number line is less than every whole number to its right.', '019c2804-6007-7706-8232-46ec8973d0c8', '22', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-600b-79d5-973b-a6ccaedc7e5d', 'Number Line Property 3', 'Every whole number on the number line is greater than every whole number to its left.', '019c2804-6007-7706-8232-46ec8973d0c8', '22', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-600c-7b33-b958-046fab8f5372', 'Addition on Number Line', 'To add, start from the first number and make jumps to the right equal to the second number.', '019c2804-6007-7706-8232-46ec8973d0c8', '22', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-600d-7ce8-96f1-fd32ea9147dd', 'Subtraction on Number Line', 'To subtract, start from the first number and make jumps to the left equal to the second number.', '019c2804-6007-7706-8232-46ec8973d0c8', '22', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-600e-7a6a-8a18-368f17989641', 'Multiplication on Number Line', 'To multiply (e.g., 3x4), start from 0, move 4 units at a time to the right, 3 times.', '019c2804-6007-7706-8232-46ec8973d0c8', '23', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-630b-737f-8cce-e50fd9617e1b', 'Definition of Factor', 'A factor of a number is an exact divisor of that number.', '019c2804-630a-71f3-a912-a7cef03e4d5e', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-630c-79dd-9d2e-156e7f55a8f5', 'Example of Factors', 'Factors of 12 are 1, 2, 3, 4, 6, and 12, as each divides 12 exactly.', '019c2804-630a-71f3-a912-a7cef03e4d5e', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-630d-7953-b9d2-d38e60b12418', 'Property: 1 is a factor', '1 is a factor of every number.', '019c2804-630a-71f3-a912-a7cef03e4d5e', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-630e-76c8-8501-d99749d5d775', 'Property: Number is a factor of itself', 'Every number is a factor of itself.', '019c2804-630a-71f3-a912-a7cef03e4d5e', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-630f-7ceb-bff5-dea778f63666', 'Property: Factors are less than or equal', 'Every factor of a number is less than or equal to the number.', '019c2804-630a-71f3-a912-a7cef03e4d5e', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6310-73f2-b8d9-7f7374014041', 'Property: Factors are exact divisors', 'Every factor of a number is an exact divisor of that number.', '019c2804-630a-71f3-a912-a7cef03e4d5e', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6311-7025-9b33-454b11037c51', 'Property: Finite number of factors', 'Every number has a finite number of factors.', '019c2804-630a-71f3-a912-a7cef03e4d5e', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6312-7f0f-8cbe-930130b9d95f', 'Finding Factors', 'Method to list all factors of a given number, demonstrated with 32.', '019c2804-630a-71f3-a912-a7cef03e4d5e', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6313-7488-9dfc-b3332aadaf20', 'Application of Factors', 'Finding two numbers given their product and sum, such as product 64 and sum 20.', '019c2804-630a-71f3-a912-a7cef03e4d5e', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6314-762e-835e-0ef634fc1414', 'Definition of Multiple', 'Multiples of a number are obtained by multiplying it by natural numbers (1, 2, 3, ...).', '019c2804-630a-71f3-a912-a7cef03e4d5e', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6315-754d-9afb-b2a87822067c', 'Relation of Multiple to Factors', 'A number is a multiple of each of its factors.', '019c2804-630a-71f3-a912-a7cef03e4d5e', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6316-7708-a7bc-9acfb0fa14ea', 'Example of Multiples', 'Multiples of 3 are 3, 6, 9, 12, etc., illustrated by skip counting.', '019c2804-630a-71f3-a912-a7cef03e4d5e', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6317-7c1b-97ca-3b0707040eef', 'Property: Number is a multiple of itself', 'Every number is a multiple of itself.', '019c2804-630a-71f3-a912-a7cef03e4d5e', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6318-73ec-ad7d-593169b6dc02', 'Property: Multiples are greater than or equal', 'Every multiple of a number is greater than or equal to the number.', '019c2804-630a-71f3-a912-a7cef03e4d5e', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6319-7473-a163-f5c12e298ea7', 'Property: Infinite number of multiples', 'Every number has an infinite number of multiples.', '019c2804-630a-71f3-a912-a7cef03e4d5e', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-631a-7a99-87d6-282f4e348abe', 'Finding Multiples within Range', 'Finding multiples of a number (e.g., 7) that are greater than a specific value but less than another (between 21 and 84).', '019c2804-630a-71f3-a912-a7cef03e4d5e', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-631b-7d40-a530-04b9741a6ce7', 'Finding First N Multiples', 'Writing the first five multiples of a given number, such as 19.', '019c2804-630a-71f3-a912-a7cef03e4d5e', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-631c-7877-8f5d-91102cde6e45', 'Perfect Numbers', 'A number is a perfect number if the sum of all its factors is twice the number itself.', '019c2804-630a-71f3-a912-a7cef03e4d5e', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-631d-779c-820a-38d877a8fd28', 'Example of Perfect Numbers', '6 and 28 are examples of perfect numbers as their factor sums are twice the number.', '019c2804-630a-71f3-a912-a7cef03e4d5e', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-631e-7549-a3e6-4566461b56ba', 'Even Numbers', 'A natural number which is a multiple of 2 (exactly divisible by 2) is called an even number.', '019c2804-630a-71f3-a912-a7cef03e4d5e', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-631f-730c-9a36-9b9b863cb6dc', 'Properties of Even Numbers', 'There are infinite even numbers, and an even number always ends in 0, 2, 4, 6, or 8.', '019c2804-630a-71f3-a912-a7cef03e4d5e', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6320-7d41-9c06-4f022d839f65', 'Odd Numbers', 'A natural number which is not a multiple of 2 (not exactly divisible by 2) is called an odd number.', '019c2804-630a-71f3-a912-a7cef03e4d5e', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6321-752c-96f1-851e41743e65', 'Properties of Odd Numbers', 'There are infinite odd numbers, and an odd number always ends in 1, 3, 5, 7, or 9.', '019c2804-630a-71f3-a912-a7cef03e4d5e', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6323-736b-9064-0871ebad8ad0', 'Prime Number Definition', 'A natural number greater than 1 with only two factors: 1 and the number itself.', '019c2804-6322-7a99-80bb-4c2ec937eaf2', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6324-718a-9bfa-236a1710b0d3', 'Properties of Prime Numbers', 'There are infinite prime numbers; 2 is the only even prime number, all other prime numbers are odd.', '019c2804-6322-7a99-80bb-4c2ec937eaf2', '4', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6325-7d8c-9faa-aafc1fd7f995', 'Composite Number Definition', 'Numbers having more than two factors are called composite numbers.', '019c2804-6322-7a99-80bb-4c2ec937eaf2', '4', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6326-7225-98cf-b2d9cf679a01', 'Examples of Composite Numbers', '4 (factors 1, 2, 4) and 6 (factors 1, 2, 3, 6) are examples of composite numbers.', '019c2804-6322-7a99-80bb-4c2ec937eaf2', '4', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6327-7d56-9c70-091654ec7272', 'Number 1', 'The number ''1'' is neither a prime nor a composite number.', '019c2804-6322-7a99-80bb-4c2ec937eaf2', '4', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6328-7d50-97b3-aba5ab503eae', 'Sieve of Eratosthenes Method', 'A method given by Greek Mathematician Eratosthenes to find prime and composite numbers from 1 to 100.', '019c2804-6322-7a99-80bb-4c2ec937eaf2', '4', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6329-73e9-ad53-dbeb506adfa0', 'Steps of Sieve of Eratosthenes', 'A process involving encircling prime numbers and crossing out their multiples to identify primes up to 100.', '019c2804-6322-7a99-80bb-4c2ec937eaf2', '4', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-632a-708d-8cfd-e1cc439a9dd7', 'Prime Numbers 1 to 100', 'The list of prime numbers from 1 to 100 obtained using the Sieve of Eratosthenes.', '019c2804-6322-7a99-80bb-4c2ec937eaf2', '4', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-632b-7479-9caf-f4338c24a848', 'Co-prime Numbers Definition', 'Two numbers are co-prime if they have no common factor other than 1.', '019c2804-6322-7a99-80bb-4c2ec937eaf2', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-632c-7a45-ab5b-14d90b9031aa', 'Examples of Co-prime Numbers', 'Pairs like (2, 3), (3, 4), (5, 7), (8, 9) are examples of co-prime numbers.', '019c2804-6322-7a99-80bb-4c2ec937eaf2', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-632d-7eed-9a6e-c1ce74ed14e7', 'Property: Prime numbers are co-prime', 'Any two prime numbers are always co-primes.', '019c2804-6322-7a99-80bb-4c2ec937eaf2', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-632e-70d7-9ca7-874e60a72f18', 'Property: Co-primes need not be prime', 'Co-prime numbers need not be prime numbers themselves; for example, 9 and 10 are co-primes.', '019c2804-6322-7a99-80bb-4c2ec937eaf2', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-632f-751e-9b04-e14308e0a2e5', 'Twin Primes Definition', 'A pair of prime numbers which differ by 2 are called twin primes.', '019c2804-6322-7a99-80bb-4c2ec937eaf2', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6330-7b3a-ba21-d35f1f01f111', 'Examples of Twin Primes', 'Pairs like (3, 5), (5, 7), (11, 13), (17, 19) are examples of twin primes.', '019c2804-6322-7a99-80bb-4c2ec937eaf2', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6331-7c88-b580-193f69907eb4', 'Prime Triplet Definition', 'A set of three consecutive prime numbers, differing by 2, is called a prime triplet.', '019c2804-6322-7a99-80bb-4c2ec937eaf2', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6332-74ae-b23c-8806f6af0302', 'Only Prime Triplet', 'The only prime triplet is (3, 5, 7).', '019c2804-6322-7a99-80bb-4c2ec937eaf2', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6333-797a-8421-cbd0b4b1be4c', 'Identifying Odd Composite Numbers', 'Demonstration to identify if a composite number can be odd and find the smallest one (which is 9).', '019c2804-6322-7a99-80bb-4c2ec937eaf2', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6334-7454-9505-d8c595381af9', 'Verifying Twin Primes', 'Checking whether a given pair of numbers (e.g., 37 and 39) are twin primes based on their primality.', '019c2804-6322-7a99-80bb-4c2ec937eaf2', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6335-7a74-8d81-7d8a9d9f8dc6', 'Finding Next Prime Number', 'Determining the next prime number greater than a specific number (e.g., 101 is the next prime after 97).', '019c2804-6322-7a99-80bb-4c2ec937eaf2', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6337-7854-a285-255f7c86e304', 'Purpose of Divisibility Rules', 'Divisibility rules help determine if a number is divisible by another without actual division.', '019c2804-6336-7bcb-a209-1c10063d53b4', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6338-7a37-b9ff-a33c506b2b74', 'Divisibility by 2 Rule', 'A number is divisible by 2 if its ones digit is 0, 2, 4, 6, or 8.', '019c2804-6336-7bcb-a209-1c10063d53b4', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6339-7556-8847-88b76cd1635c', 'Divisibility by 3 Rule', 'A number is divisible by 3 if the sum of its digits is divisible by 3.', '019c2804-6336-7bcb-a209-1c10063d53b4', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-633a-7c6f-ae64-99ca9003c53f', 'Divisibility by 4 Rule', 'A number is divisible by 4 if its last two digits are 0s or form a number divisible by 4.', '019c2804-6336-7bcb-a209-1c10063d53b4', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-633b-7a81-9c65-d9b1e194cb96', 'Divisibility by 5 Rule', 'A number is divisible by 5 if its ones digit is either 0 or 5.', '019c2804-6336-7bcb-a209-1c10063d53b4', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-633c-7c93-9fca-e017d0b145f2', 'Divisibility by 6 Rule', 'A number is divisible by 6 if it is divisible by both 2 and 3.', '019c2804-6336-7bcb-a209-1c10063d53b4', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-633d-7aee-b5a9-24b7cbe9c22e', 'Divisibility by 7 Rule', 'A number is divisible by 7 if the difference between twice the digit at the ones place and the number formed by the remaining digits is 0 or a multiple of 7.', '019c2804-6336-7bcb-a209-1c10063d53b4', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-633e-74c5-8aa6-d303dae8538f', 'Divisibility by 8 Rule', 'A number is divisible by 8 if the number formed by its last three digits is divisible by 8.', '019c2804-6336-7bcb-a209-1c10063d53b4', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-633f-7415-9080-17fb5b5945c6', 'Divisibility by 9 Rule', 'A number is divisible by 9 if the sum of its digits is divisible by 9.', '019c2804-6336-7bcb-a209-1c10063d53b4', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6340-717e-b72d-b39db189ff7f', 'Divisibility by 10 Rule', 'A number is divisible by 10 if the digit at its ones place is 0.', '019c2804-6336-7bcb-a209-1c10063d53b4', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6341-76a6-99b6-a10d358a56e7', 'Divisibility by 11 Rule', 'A number is divisible by 11 if the difference between the sum of digits at odd places (from the right) and the sum of digits at even places is 0 or a multiple of 11.', '019c2804-6336-7bcb-a209-1c10063d53b4', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6342-77d8-a691-12a4a6930405', 'Applying Divisibility by 2', 'Checking if given numbers (e.g., 3250, 9628) are divisible by 2 using the ones digit rule.', '019c2804-6336-7bcb-a209-1c10063d53b4', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6343-73a9-b4e1-a257283219a9', 'Applying Divisibility by 3', 'Checking if given numbers (e.g., 5412, 5463) are divisible by 3 using the sum of digits rule.', '019c2804-6336-7bcb-a209-1c10063d53b4', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6344-704b-ac64-e844f8de7239', 'Applying Multiple Divisibility Rules', 'Testing the divisibility of numbers by 11, 4, 8, and 6, demonstrating the application of multiple rules.', '019c2804-6336-7bcb-a209-1c10063d53b4', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6346-70a9-8270-894add5add04', 'Common Factors Definition', 'Factors that are shared by two or more numbers are called common factors.', '019c2804-6345-71d0-b806-f9e50fa83542', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6347-7b63-ad52-7393120b5de8', 'Finding Common Factors of Two Numbers', 'Method to find common factors for two numbers, illustrated with 12 and 18.', '019c2804-6345-71d0-b806-f9e50fa83542', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6348-7356-b963-a9fae1ea0937', 'Finding Common Factors of Three Numbers', 'Method to find common factors for three numbers, illustrated with 4, 12, and 16.', '019c2804-6345-71d0-b806-f9e50fa83542', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6349-7011-a501-fd2d14f072e9', 'Common Multiples Definition', 'Multiples that are shared by two or more numbers are called common multiples.', '019c2804-6345-71d0-b806-f9e50fa83542', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-634a-7efb-9097-137b16e9f648', 'Finding Common Multiples', 'Listing multiples of numbers (e.g., 4 and 6) to identify their common multiples.', '019c2804-6345-71d0-b806-f9e50fa83542', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-634b-774f-99bf-d1f34bb797e0', 'Finding First N Common Multiples', 'Method to find the first three common multiples of given numbers, such as 6 and 8.', '019c2804-6345-71d0-b806-f9e50fa83542', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-634d-7120-a4c0-280af5808946', 'Prime Factorisation Definition', 'Expressing a number as the product of its prime factors.', '019c2804-634c-7f74-b8dd-7153f320be8b', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-634e-7ef5-b5d2-6291d9453961', 'Fundamental Theorem of Arithmetic', 'Every composite number can be written as the product of prime factors in a unique way, except for the order of the factors.', '019c2804-634c-7f74-b8dd-7153f320be8b', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-634f-79de-82ce-0bee81527e0e', 'Factor Tree Method', 'A visual method to find the prime factorisation of a number by branching factors until all are prime numbers.', '019c2804-634c-7f74-b8dd-7153f320be8b', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6350-74ff-8215-360200f145e0', 'Factor Tree Example', 'Demonstration of making a factor tree for 36 in three different ways.', '019c2804-634c-7f74-b8dd-7153f320be8b', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6351-7580-837c-6ad5469e173b', 'Division Method for Prime Factorisation', 'A step-by-step division process using prime numbers to find prime factors of a composite number.', '019c2804-634c-7f74-b8dd-7153f320be8b', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6352-75f6-bcf1-5e879a74707f', 'Division Method Example', 'Finding the prime factorisation of 216 using the division method.', '019c2804-634c-7f74-b8dd-7153f320be8b', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6353-7d81-b1c7-3508fb59aa45', 'Expressing Numbers as Product of Primes', 'Applying the division method to express numbers (e.g., 980, 8712) as a product of their prime factors.', '019c2804-634c-7f74-b8dd-7153f320be8b', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6354-73d4-8625-68e37d95328a', 'Smallest Number with Four Prime Factors', 'Finding the smallest number that has four different prime factors.', '019c2804-634c-7f74-b8dd-7153f320be8b', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6356-7182-ab9a-005fea8647ff', 'HCF Definition', 'The highest (or greatest) of the common factors of two or more given numbers, also known as Greatest Common Divisor (GCD).', '019c2804-6355-7c53-bec3-0c34bd6c2d93', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6357-774d-8e21-a7e8a30978bd', 'Finding HCF by Listing Factors', 'Method to find HCF by listing all factors of numbers (e.g., 24 and 36) and identifying the highest common one.', '019c2804-6355-7c53-bec3-0c34bd6c2d93', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6358-7fb7-a9c0-dac807f581ae', 'Prime Factorisation Method for HCF', 'Steps to find HCF: prime factorise each number, identify common prime factors, and multiply them to get the HCF.', '019c2804-6355-7c53-bec3-0c34bd6c2d93', '11', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6359-7de2-9d5b-be6b023c6c34', 'Finding HCF of Two Numbers (Prime Factorisation)', 'Applying the prime factorisation method to find the HCF of two numbers, such as 18 and 48.', '019c2804-6355-7c53-bec3-0c34bd6c2d93', '11', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-635a-7df0-8976-72d52ff9c315', 'Finding HCF of Three Numbers (Prime Factorisation)', 'Applying the prime factorisation method to find the HCF of three numbers, such as 12, 16, 28 or 70, 105, 175.', '019c2804-6355-7c53-bec3-0c34bd6c2d93', '11', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-635b-7333-b8be-48f722787133', 'HCF of Co-prime Numbers', 'The HCF of co-prime numbers is always 1, not 0, because 1 is a factor of every number.', '019c2804-6355-7c53-bec3-0c34bd6c2d93', '11', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-635c-7f56-83b9-8f9af3c6e671', 'Long Division Method for HCF (Euclid''s Algorithm)', 'Euclid''s algorithm is a method to find the HCF of two or more numbers by repeatedly dividing until the remainder is zero.', '019c2804-6355-7c53-bec3-0c34bd6c2d93', '12', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-635d-7ce6-86f1-262a8480afcc', 'Steps of Long Division Method for HCF', 'Detailed steps for applying Euclid''s algorithm: identify greater number, divide, use remainder as new divisor, repeat until zero remainder.', '019c2804-6355-7c53-bec3-0c34bd6c2d93', '12', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-635e-71c3-b4b0-33d07f5881b8', 'Applying Long Division Method for HCF (Two Numbers)', 'Determining the HCF of two numbers (e.g., 18 and 30, or 1045 and 1520) using the long division method.', '019c2804-6355-7c53-bec3-0c34bd6c2d93', '12', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-635f-754f-9a9f-e37d64726f90', 'Applying Long Division Method for HCF (Three Numbers)', 'Determining the HCF of three numbers (e.g., 2349, 2835, 3078) by finding the HCF of two first, then of the result and the third number.', '019c2804-6355-7c53-bec3-0c34bd6c2d93', '12', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6360-72a3-b517-3c29bb2911c6', 'Application: Longest Tape for Room Dimensions', 'Finding the longest tape that can measure the length, breadth, and height of a room exactly (HCF application).', '019c2804-6355-7c53-bec3-0c34bd6c2d93', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6361-7094-bbee-74bec3d08586', 'Application: Maximum Container Capacity', 'Finding the maximum capacity of a container that can measure given quantities of liquid an exact number of times (HCF application).', '019c2804-6355-7c53-bec3-0c34bd6c2d93', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6362-7095-a397-afc97f2251ee', 'Application: Greatest Number with Remainder', 'Finding the greatest number that divides given numbers (e.g., 615 and 963) leaving a specific remainder (e.g., 6) in each case.', '019c2804-6355-7c53-bec3-0c34bd6c2d93', '14', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6363-7224-aff1-c346466792f3', 'Application: Greatest Number with Different Remainders', 'Finding the greatest number that divides given numbers (e.g., 781 and 458) leaving different specific remainders (e.g., 1 and 3).', '019c2804-6355-7c53-bec3-0c34bd6c2d93', '14', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6364-72ca-aa5d-11fbede9240e', 'Application: Arranging Items in Equal Heaps', 'Finding the greatest number of fruits possible in each heap when arranging different quantities of fruits into equal heaps (HCF application).', '019c2804-6355-7c53-bec3-0c34bd6c2d93', '14', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6365-7169-9422-f03827ef4054', 'Application: Minimum Rooms for Participants', 'Finding the minimum number of rooms required for a seminar where participants from different subjects are seated equally in each room (HCF application).', '019c2804-6355-7c53-bec3-0c34bd6c2d93', '15', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6367-74e1-98bb-9b718cc28909', 'LCM Definition', 'The smallest of the common multiples of two or more given numbers, which is exactly divisible by each of them.', '019c2804-6366-7708-8e38-71e2b84eeaaf', '16', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6368-7583-beb0-eaf9c16e5806', 'Finding LCM by Listing Multiples', 'Method to find LCM by listing multiples of numbers (e.g., 4 and 6) and identifying the smallest common one.', '019c2804-6366-7708-8e38-71e2b84eeaaf', '16', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6369-70f6-ba91-f6ee1c97f1c7', 'Prime Factorisation Method for LCM', 'Steps to find LCM: write numbers as products of prime factors, count the maximum occurrence of each factor, and multiply them.', '019c2804-6366-7708-8e38-71e2b84eeaaf', '16', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-636a-7db8-b42d-b49c0f46dca0', 'Finding LCM of Two Numbers (Prime Factorisation)', 'Applying the prime factorisation method to find the LCM of two numbers, such as 27 and 81.', '019c2804-6366-7708-8e38-71e2b84eeaaf', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-636b-7b33-9238-55e280506384', 'Finding LCM of Three Numbers (Prime Factorisation)', 'Applying the prime factorisation method to find the LCM of three numbers (e.g., 24, 36, 54 or 12, 24, 36).', '019c2804-6366-7708-8e38-71e2b84eeaaf', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-636c-79e7-a5b9-5e5f1e800ae3', 'Finding LCM of Four Numbers (Prime Factorisation)', 'Applying the prime factorisation method to find the LCM of four numbers, such as 15, 20, 35.', '019c2804-6366-7708-8e38-71e2b84eeaaf', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-636d-7016-8474-0cd3eb859ca2', 'Common Division Method for LCM', 'A method to find LCM by arranging numbers in a row and repeatedly dividing them by the least prime number that divides at least one.', '019c2804-6366-7708-8e38-71e2b84eeaaf', '18', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-636e-774b-bf48-f8fe8ab593ee', 'Steps of Common Division Method for LCM', 'Detailed process for applying the common division method to find LCM, involving rows of quotients and prime divisors.', '019c2804-6366-7708-8e38-71e2b84eeaaf', '18', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-636f-79a3-be33-0312fdec03a0', 'Applying Common Division Method for LCM (Three Numbers)', 'Finding the LCM of three numbers (e.g., 36, 45, 60 or 24, 28, 196) using the common division method.', '019c2804-6366-7708-8e38-71e2b84eeaaf', '18', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6370-7310-a67a-a2f4b1da0cff', 'Applying Common Division Method for LCM (Multiple Numbers)', 'Finding the LCM of multiple numbers (e.g., 108, 135, 162) using the common division method.', '019c2804-6366-7708-8e38-71e2b84eeaaf', '19', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6371-77c7-a551-16167d099c7d', 'Application: Least Number with Remainder', 'Finding the least number which, when divided by given numbers (e.g., 6, 15, 18), leaves a specific remainder (e.g., 5).', '019c2804-6366-7708-8e38-71e2b84eeaaf', '19', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6372-707b-b190-d49480d05453', 'Application: Greatest N-digit Number Divisible by Numbers', 'Determining the greatest 3-digit number that is exactly divisible by given numbers (e.g., 8, 10, and 12).', '019c2804-6366-7708-8e38-71e2b84eeaaf', '19', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6373-7a19-bd90-c9dd63b5bf4a', 'Application: Smallest N-digit Number Divisible by Numbers', 'Determining the smallest 3-digit number that is exactly divisible by given numbers (e.g., 6, 8, and 12).', '019c2804-6366-7708-8e38-71e2b84eeaaf', '19', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6374-767d-9dbf-ec04b578c89a', 'Application: Bells Ringing Together', 'Finding when bells will ring together again, given their individual ringing intervals (LCM application).', '019c2804-6366-7708-8e38-71e2b84eeaaf', '20', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6375-7f28-ab5b-f5d83a9abd42', 'Application: Smallest Number Reduced by X is Divisible', 'Finding the smallest number which, when reduced by a certain value (e.g., 6), becomes divisible by given numbers (e.g., 12, 15, 20, 27).', '019c2804-6366-7708-8e38-71e2b84eeaaf', '20', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6377-75d4-a100-4a3117ae0469', 'Property: HCF is less than or equal to numbers', 'The HCF of the given numbers is always smaller than or equal to the given numbers.', '019c2804-6376-70e9-b470-26d394ffc2a9', '21', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6378-7340-98dd-1efc365e73e8', 'Property: LCM is greater than or equal to numbers', 'The LCM of the given numbers is always greater than or equal to the numbers.', '019c2804-6376-70e9-b470-26d394ffc2a9', '21', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6379-7398-9a02-c7ce408a9e74', 'Property: HCF of Co-prime Numbers', 'The HCF of two co-prime numbers is always 1.', '019c2804-6376-70e9-b470-26d394ffc2a9', '21', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-637a-7db0-9d32-803de99da49c', 'Property: LCM of Prime Numbers', 'The LCM of two prime numbers is equal to their product.', '019c2804-6376-70e9-b470-26d394ffc2a9', '21', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-637b-73a0-88ff-455241bcf17b', 'Property: LCM of Co-prime Numbers', 'The LCM of two co-prime numbers is also equal to their product.', '019c2804-6376-70e9-b470-26d394ffc2a9', '21', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-637c-7ea1-9757-0884edf416b2', 'Property: HCF is a factor of LCM', 'The HCF of the given numbers is always a factor of their LCM.', '019c2804-6376-70e9-b470-26d394ffc2a9', '21', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-637d-737c-a371-a74d1666964b', 'Property: If ''a'' is factor of ''b''', 'If ''a'' is a factor of ''b'', then their HCF = ''a'' and their LCM = ''b''.', '019c2804-6376-70e9-b470-26d394ffc2a9', '21', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-637e-7fcc-be38-c7f98dd420ae', 'Relationship Formula (Product of Numbers, HCF, LCM)', 'The product of the HCF and LCM of two numbers is equal to the product of the numbers (a x b = LCM x HCF).', '019c2804-6376-70e9-b470-26d394ffc2a9', '21', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-637f-7e9e-91f7-578ef610aa91', 'Applying HCF-LCM Relationship', 'Verifying the relationship between HCF, LCM, and product of two numbers, demonstrated with 24 and 36.', '019c2804-6376-70e9-b470-26d394ffc2a9', '21', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6380-73d6-a9f8-02a0dede4817', 'Finding LCM using Product and HCF', 'Finding the LCM of two numbers when their HCF and product are given.', '019c2804-6376-70e9-b470-26d394ffc2a9', '22', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6381-7cd5-829c-54745022c4a9', 'Finding Other Number (Co-primes)', 'Finding the other number when the LCM of two co-prime numbers and one of the numbers are given.', '019c2804-6376-70e9-b470-26d394ffc2a9', '22', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6382-76f0-a4ce-80fe2ed46d9b', 'Checking HCF-LCM Compatibility', 'Explaining why two numbers cannot have a specific HCF and LCM if the HCF does not exactly divide the LCM.', '019c2804-6376-70e9-b470-26d394ffc2a9', '22', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6385-70fd-837e-979f40e5183d', 'Subtraction of Whole Numbers', 'When subtracting a smaller whole number from a larger whole number, the result is a whole number.', '019c2804-6384-718d-9ae0-fab46d9fedfa', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6386-75ca-8f32-c8954becd849', 'Need for Integers', 'The system of whole numbers is insufficient for operations where a larger number is subtracted from a smaller number, necessitating an extension of the number system.', '019c2804-6384-718d-9ae0-fab46d9fedfa', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6388-7f29-9cba-b70a3cfc67c3', 'Natural Numbers and their Opposites', 'Natural numbers are 1, 2, 3... Their opposites are called negative numbers, written as -1, -2, -3,...', '019c2804-6387-74a0-b6cf-9e9992256741', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6389-7e4f-9aed-c410faed9907', 'Definition of Integers', 'The new collection of numbers formed by combining whole numbers (0, 1, 2, 3,...) and negative numbers (-1, -2, -3,...) is known as integers.', '019c2804-6387-74a0-b6cf-9e9992256741', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-638a-754e-96cd-200d6359853d', 'Positive Integers', 'The numbers +1, +2, +3,... (or 1, 2, 3,...) are called positive integers.', '019c2804-6387-74a0-b6cf-9e9992256741', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-638b-70c2-8df9-710ad2fcc53b', 'Negative Integers', 'The numbers -1, -2, -3,... are called negative integers.', '019c2804-6387-74a0-b6cf-9e9992256741', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-638c-7d4d-a1f9-02c3b96b7515', 'Successor and Predecessor', 'Every integer has a successor and a predecessor.', '019c2804-6387-74a0-b6cf-9e9992256741', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-638d-7e59-b28b-91a8dd28de3b', 'Zero (0)', 'Zero (0) is neither positive nor negative.', '019c2804-6387-74a0-b6cf-9e9992256741', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-638f-7a07-a927-dcebda79a4ad', 'Representing Movement', 'Movement up (e.g., floors) is represented by positive integers, and movement down by negative integers.', '019c2804-638e-7a97-97f0-5c857573c935', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6390-7d45-8391-fea23b34db37', 'Representing Historical Eras', 'BCE years are represented by negative integers, while CE years are represented by positive integers.', '019c2804-638e-7a97-97f0-5c857573c935', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6391-7976-beb3-6a3514619089', 'Representing Temperature', 'Negative numbers are used to measure temperature below 0°C.', '019c2804-638e-7a97-97f0-5c857573c935', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6392-7860-9339-5df559ad61a5', 'Representing Altitude/Depth', 'Positive integers indicate distance above sea level, and negative integers indicate distance below sea level.', '019c2804-638e-7a97-97f0-5c857573c935', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6394-7b86-aa51-80d87430b00f', 'Number Line Setup', 'A number line has zero in the middle. Positive integers are marked to the right of 0, and negative integers to the left of 0, all at equal distances.', '019c2804-6393-7e64-9716-abffea8cd26f', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6395-7d95-8044-34ebc4523f97', 'Opposite Numbers on Number Line', 'For every natural number, a negative number exists at an equal distance from 0 on the opposite side of the number line (e.g., 1 and -1).', '019c2804-6393-7e64-9716-abffea8cd26f', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6397-7ce1-b262-0053b138a180', 'Comparison Rule', 'Every integer on the number line is greater than any integer to its left.', '019c2804-6396-75db-963c-5bdad726e82b', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6398-7ff2-8bc8-84b863fa77f4', 'Conclusions on Integer Comparison', 'Positive integers are greater than 0. Negative integers are less than 0. Positive integers are greater than negative integers.', '019c2804-6396-75db-963c-5bdad726e82b', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6399-7018-9192-db742c0bd206', 'Inequality with Opposites', 'If ''a'' and ''b'' are two integers such that a > b, then their negatives will satisfy -a < -b.', '019c2804-6396-75db-963c-5bdad726e82b', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-639a-7682-8899-fcac8067e43f', 'Smallest Positive and Greatest Negative Integer', '1 is the smallest positive integer, but -1 is the greatest negative integer.', '019c2804-6396-75db-963c-5bdad726e82b', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-639c-7d17-95a6-24219d11352c', 'Definition of Absolute Value', 'The absolute value of an integer is its numerical value irrespective of its sign, denoted by vertical lines (e.g., |-3|).', '019c2804-639b-79a6-84a1-eab6d83b00f1', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-639d-77e0-b25f-36a18dc2a247', 'Absolute Value is Always Positive', 'The absolute value of any number is always positive, with |0| = 0.', '019c2804-639b-79a6-84a1-eab6d83b00f1', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-639f-7fd9-9fc7-86fce83f3e43', 'Negative of Positive Integer', 'The negative of a positive integer is a negative integer (e.g., negative of 4 is -4).', '019c2804-639e-751a-b389-58c6e3c51262', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63a0-7f71-bc82-c2ab56187a7f', 'Negative of Negative Integer', 'The negative of a negative integer is a positive integer (e.g., -(-4) = +4).', '019c2804-639e-751a-b389-58c6e3c51262', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63a2-72a1-99ef-9edd4a8e3599', 'Rules for Adding Two Positive Integers', 'To add two positive integers, find the sum of their absolute values and place a positive sign.', '019c2804-63a1-718f-bf1d-421d71e47eb4', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63a3-70e8-ae83-0e3dc7301cfa', 'Rules for Adding Two Negative Integers', 'To add two negative integers, find the sum of their absolute values and place a negative sign.', '019c2804-63a1-718f-bf1d-421d71e47eb4', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63a4-75eb-8482-d837fc5e7d25', 'Rules for Adding a Positive and a Negative Integer', 'Find the difference of their absolute values. Place the sign of the integer with the greater absolute value before the result.', '019c2804-63a1-718f-bf1d-421d71e47eb4', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63a6-7020-aa9f-429d151ec4ad', 'Representing Positive and Negative Numbers on Number Line', 'Positive numbers mean moving right from zero, and negative numbers mean moving left from zero.', '019c2804-63a5-715a-af06-a7bb3a533d1c', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63a7-7443-9c3d-2c41369ea2e5', 'Adding Two Positive Integers on Number Line', 'To add two positive integers, start at zero, move right by the first number, then continue moving right by the second number.', '019c2804-63a5-715a-af06-a7bb3a533d1c', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63a8-76d8-b0f3-57c3bd3951fb', 'Adding Positive and Negative Integers on Number Line (Positive Result)', 'To add a negative and a positive integer, move left for the negative part then right for the positive part.', '019c2804-63a5-715a-af06-a7bb3a533d1c', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63a9-7efd-ae90-5f7888a6a113', 'Adding Positive and Negative Integers on Number Line (Negative Result)', 'To add a positive and a negative integer, move right for the positive part then left for the negative part.', '019c2804-63a5-715a-af06-a7bb3a533d1c', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63aa-7ed7-ae0a-7a0cb6e5114c', 'Adding Two Negative Integers on Number Line', 'To add two negative integers, start at zero, move left by the first number, then continue moving left by the second number.', '019c2804-63a5-715a-af06-a7bb3a533d1c', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63ac-7d3b-94ee-4fd59ade3b94', 'Closure Property of Addition', 'The sum of any two integers (a and b) is always an integer (a + b).', '019c2804-63ab-7ea5-b513-8b18fb1c912a', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63ad-7d89-865b-0b09104147c1', 'Commutative Property of Addition', 'The order of integers in addition does not affect the sum (a + b = b + a).', '019c2804-63ab-7ea5-b513-8b18fb1c912a', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63ae-73bb-8662-6cc19877fcd9', 'Associative Property of Addition', 'The grouping of integers in addition does not affect the sum ((a + b) + c = a + (b + c)).', '019c2804-63ab-7ea5-b513-8b18fb1c912a', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63af-72dd-89b0-463fbea78ab9', 'Existence of Additive Identity', 'Zero (0) is the additive identity; adding 0 to any integer ''a'' leaves ''a'' unchanged (a + 0 = a).', '019c2804-63ab-7ea5-b513-8b18fb1c912a', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63b0-798d-812b-6a62635f860f', 'Existence of Additive Inverse', 'For every integer ''a'', there exists an opposite ''-a'' such that their sum is 0 (a + (-a) = 0).', '019c2804-63ab-7ea5-b513-8b18fb1c912a', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63b2-7658-a4b6-a1a35cabdb2f', 'Definition of Successor', 'The successor of an integer is obtained by adding 1 to the integer.', '019c2804-63b1-7b3a-9a77-44657a5b2aac', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63b4-7d80-b131-ad25d70c1629', 'Subtraction as Inverse of Addition', 'Subtracting integer ''b'' from ''a'' is equivalent to adding the additive inverse of ''b'' to ''a'' (a - b = a + (-b)).', '019c2804-63b3-7153-a8e7-0a5e40079ce3', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63b5-7991-a48e-c4a5fff0f5ad', 'Rule for Subtracting Integers', 'To subtract one integer from another, find the additive inverse of the integer being subtracted and add it to the other integer.', '019c2804-63b3-7153-a8e7-0a5e40079ce3', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63b7-7545-af68-dbf80782cfb7', 'Movement Rules for Addition on Number Line', 'To add a positive integer, move right; to add a negative integer, move left.', '019c2804-63b6-7d4b-a427-47462d78aa74', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63b8-78d7-a30c-2abc7e5815f5', 'Subtracting a Positive Integer on Number Line', 'Subtracting a positive integer means moving left on the number line.', '019c2804-63b6-7d4b-a427-47462d78aa74', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63b9-7df0-b18b-bd6b70ce1dc8', 'Subtracting a Negative Integer on Number Line', 'Subtracting a negative integer means moving right on the number line (equivalent to adding its positive).', '019c2804-63b6-7d4b-a427-47462d78aa74', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63bb-7a11-bda9-d4e12f2237ac', 'Closure Property of Subtraction', 'The difference between any two integers (a and b) is always an integer (a - b).', '019c2804-63ba-7ca4-a3fa-c392657f277f', '11', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63bc-75f8-a01c-21ad89909cf5', 'Subtraction is Not Commutative', 'The order of integers in subtraction affects the result (a - b ≠ b - a).', '019c2804-63ba-7ca4-a3fa-c392657f277f', '11', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63bd-79f0-97c4-e62f8a165d4e', 'Subtraction is Not Associative', 'The grouping of integers in subtraction affects the result ((a - b) - c ≠ a - (b - c)).', '019c2804-63ba-7ca4-a3fa-c392657f277f', '11', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63be-76ec-a1dc-193b357969c7', 'Subtraction with Zero', 'Subtracting zero from an integer ''a'' leaves ''a'' unchanged (a - 0 = a).', '019c2804-63ba-7ca4-a3fa-c392657f277f', '11', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-63c0-7795-8c48-d467ac357ee1', 'Definition of Predecessor', 'The predecessor of an integer is obtained by subtracting 1 from the integer.', '019c2804-63bf-70e9-a273-084edb678711', '11', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6011-781f-ac16-c895b766bbca', 'Definition of a fraction', 'A fraction is a number representing part of the whole.', '019c2804-6010-7ad5-bab9-71667f43a71a', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6012-7224-9249-f17343a8f505', 'Form of a fraction', 'A fraction is of the form a/b, where ''a'' and ''b'' are whole numbers and ''b'' is not equal to 0.', '019c2804-6010-7ad5-bab9-71667f43a71a', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6013-7cad-a8b9-05f6e6dfcac9', 'Numerator', 'The number above the bar in a fraction, indicating how many parts are being considered.', '019c2804-6010-7ad5-bab9-71667f43a71a', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6014-7f38-9a8f-8416a7fc838f', 'Denominator', 'The number below the bar in a fraction, indicating the total number of equal parts.', '019c2804-6010-7ad5-bab9-71667f43a71a', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6016-77c2-8ca8-a7dfab7c1235', 'Fractions as parts of a collection', 'Fractions can also be parts of a collection.', '019c2804-6015-70d5-ac3d-0199a2441ca0', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6018-792d-9d35-b042b757ac76', 'Representing fractions on number line', 'Fractions can be shown on the number line.', '019c2804-6017-7838-bf99-9584bb226238', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6019-7629-8421-69f02dfd6bef', 'Dividing unit length for fractions', 'The unit length between 0 and 1 is divided into equal parts to represent fractions.', '019c2804-6017-7838-bf99-9584bb226238', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-601b-7f19-8a61-c6736cc074b0', 'Proper Fraction Definition', 'A fraction whose numerator is less than the denominator is called a proper fraction.', '019c2804-601a-7b38-a787-209d4b4a2417', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-601c-7923-9b66-68466b700fc0', 'Value of a Proper Fraction', 'A proper fraction is always less than 1.', '019c2804-601a-7b38-a787-209d4b4a2417', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-601d-7892-b97e-97a11a5fe6b2', 'Improper Fraction Definition', 'A fraction whose numerator is greater than the denominator is called an improper fraction.', '019c2804-601a-7b38-a787-209d4b4a2417', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-601e-7689-8c4e-cc975a985b61', 'Mixed Fraction Definition', 'A fraction that is a combination of a whole number and a proper fraction.', '019c2804-601a-7b38-a787-209d4b4a2417', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-601f-7e24-86cc-5a0b3b480860', 'Mixed fractions as improper fractions', 'All mixed fractions can be expressed as improper fractions.', '019c2804-601a-7b38-a787-209d4b4a2417', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6021-7e52-91b2-89952ceb547d', 'Converting Improper to Mixed Fraction', 'To convert an improper fraction into a mixed fraction, follow specific steps.', '019c2804-6020-7c24-ab03-027138215da5', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6022-758a-b857-ee69ca90089c', 'Steps for Improper to Mixed Conversion', 'Divide numerator by denominator; quotient is whole number, remainder is new numerator, original denominator retained.', '019c2804-6020-7c24-ab03-027138215da5', '6', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6023-72f1-83c1-bc58b0d9fb41', 'Mixed to Improper Fraction', 'A mixed fraction is a combination of a whole number and a proper fraction.', '019c2804-6020-7c24-ab03-027138215da5', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6024-74da-82f4-beb882cb6559', 'Steps for Mixed to Improper Conversion', 'Multiply whole number by denominator, add numerator to product, then retain original denominator.', '019c2804-6020-7c24-ab03-027138215da5', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6026-7e14-8b6c-0e35807a2c74', 'Definition of Equivalent Fractions', 'Equivalent fractions are fractions that represent the same value.', '019c2804-6025-7aac-bc1f-d6a48ca16980', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6027-7536-adfb-75fe48a638e4', 'Finding Equivalent Fractions', 'To obtain equivalent fractions, multiply or divide both the numerator and denominator by the same non-zero natural number.', '019c2804-6025-7aac-bc1f-d6a48ca16980', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6028-7ae9-a1df-3dc61adc6df8', 'Checking Equivalent Fractions (Cross Multiplication)', 'To check if two fractions a/b and c/d are equivalent, cross multiply (ad and bc).', '019c2804-6025-7aac-bc1f-d6a48ca16980', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-602a-7e94-bb2d-6629685030e7', 'Definition of Simplest Form', 'A fraction is in its simplest form if its numerator and denominator have no common factor except 1.', '019c2804-6029-7cef-8cd1-41839f7e80b5', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-602b-7663-97a1-fc635ba57de3', 'Obtaining Simplest Form by HCF', 'The lowest terms of a fraction can be obtained by dividing both the numerator and the denominator by their HCF.', '019c2804-6029-7cef-8cd1-41839f7e80b5', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-602c-7a4f-86f5-cd8e66656926', 'Reducing by cancelling common factors', 'A fraction can be reduced to lowest terms by cancelling the common factors in steps.', '019c2804-6029-7cef-8cd1-41839f7e80b5', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-602e-7f29-8c09-619b5d309a22', 'Definition of Like Fractions', 'Fractions having the same denominator are called like fractions.', '019c2804-602d-7eac-b2b0-de9955aa8b10', '11', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-602f-78ff-94c3-a9fd6313e71c', 'Definition of Unlike Fractions', 'Fractions with different denominators are called unlike fractions.', '019c2804-602d-7eac-b2b0-de9955aa8b10', '11', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6031-73af-b0fc-c980720cd0a9', 'Comparing Like Fractions', 'If two or more fractions have the same denominator, the fraction with the greater numerator is greater.', '019c2804-6030-71bb-a742-9c555a2be9fa', '11', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6032-7464-acb0-1219c61796f2', 'Comparing Unlike Fractions (Same Numerator)', 'If two or more fractions have the same numerator, the fraction with the smaller denominator is greater.', '019c2804-6030-71bb-a742-9c555a2be9fa', '11', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6033-70ab-bd69-87903b0f4d32', 'Comparing Unlike Fractions (Different Numerators and Denominators - LCM Method)', 'To compare unlike fractions, convert them into like fractions using the LCM of their denominators.', '019c2804-6030-71bb-a742-9c555a2be9fa', '12', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6034-75ac-a294-fc3245c606de', 'Steps for Comparing Unlike Fractions (LCM Method)', 'Find LCM of denominators; convert to equivalent fractions with LCM as common denominator; then compare numerators.', '019c2804-6030-71bb-a742-9c555a2be9fa', '12', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6035-7e63-a4a7-4adff7819ca9', 'Comparing Two Fractions (Cross Multiplication Method)', 'For two fractions a/b and c/d, compare by checking if a*d is greater than or less than b*c.', '019c2804-6030-71bb-a742-9c555a2be9fa', '12', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6037-742a-ba6a-84dfa4480d5b', 'Adding Like Fractions', 'To add like fractions, add the numerators and retain the common denominator.', '019c2804-6036-79f9-8e29-41509c9388c6', '14', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6038-70da-b1bc-ccf852f2c762', 'Subtracting Like Fractions', 'To find the difference of two like fractions, subtract the smaller numerator from the bigger and retain the common denominator.', '019c2804-6036-79f9-8e29-41509c9388c6', '15', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6039-70c2-8deb-c419e589b5a6', 'Adding and Subtracting Unlike Fractions', 'To add or subtract unlike fractions, convert them into equivalent fractions with the same denominator.', '019c2804-6036-79f9-8e29-41509c9388c6', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-603a-78d9-a2f9-588ec45a74ac', 'Steps for Adding/Subtracting Unlike Fractions', 'Find the LCM of denominators; convert each fraction to equivalent fraction with LCM as common denominator; then add or subtract as required.', '019c2804-6036-79f9-8e29-41509c9388c6', '17', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6291-7b0f-902b-7e739cce8cc0', 'Definition', 'A fraction whose denominator is 10, 100 or 1000 is called a decimal fraction.', '019c2804-6290-7227-8cdb-95cad475a53c', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6292-7772-82f2-27b08bf27fc6', 'Examples', 'Examples like 7/10, 7/100, 7/1000 are decimal fractions.', '019c2804-6290-7227-8cdb-95cad475a53c', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6293-723f-b12f-538d24062464', 'Tenths Definition', 'Decimal fractions with 10 as denominator are called tenths.', '019c2804-6290-7227-8cdb-95cad475a53c', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6294-7175-89a1-1da83bb23c38', 'Representing One-Tenth', 'One part out of 10 equal parts, represented as 1/10 or 0.1 (read as zero point one).', '019c2804-6290-7227-8cdb-95cad475a53c', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6295-7195-a192-66f0f3559b7a', 'Representing Seven-Tenths', 'Seven parts out of 10 equal parts, represented as 7/10 or 0.7 (read as zero point seven).', '019c2804-6290-7227-8cdb-95cad475a53c', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6296-70b1-9db0-593bb2a59e4c', 'Hundredths Definition', 'Decimal fractions with 100 as denominator are called hundredths.', '019c2804-6290-7227-8cdb-95cad475a53c', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6297-7faf-802b-e9360217cf4e', 'Representing One-Hundredth', 'One part out of 100 equal parts, represented as 1/100 or 0.01 (read as zero point zero one).', '019c2804-6290-7227-8cdb-95cad475a53c', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6298-77a4-84d5-9d96e3384b74', 'Representing Ninety-Three-Hundredths', 'Ninety-three parts out of 100 equal parts, represented as 93/100 or 0.93 (read as zero point nine three).', '019c2804-6290-7227-8cdb-95cad475a53c', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6299-7f73-a7ff-28b180d4e4dd', 'Thousandths Definition', 'Decimal fractions with 1000 as denominator are called thousandths.', '019c2804-6290-7227-8cdb-95cad475a53c', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-629a-70cd-9677-87c9a2803a1c', 'Representing One-Thousandth', 'One part out of 1000, represented as 1/1000 or 0.001 (read as zero point zero zero one).', '019c2804-6290-7227-8cdb-95cad475a53c', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-629b-7c79-8a9c-2313792ebc54', 'Representing Seven-Thousandths', 'Seven parts out of 1000, represented as 7/1000 or 0.007 (read as zero point zero zero seven).', '019c2804-6290-7227-8cdb-95cad475a53c', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-629c-764c-987f-c36e884b244f', 'Digits After Decimal for Tenths', 'Tenths have one digit after the decimal point.', '019c2804-6290-7227-8cdb-95cad475a53c', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-629d-773f-9b3f-9d1f5b912dbf', 'Digits After Decimal for Hundredths', 'Hundredths have two digits after the decimal point.', '019c2804-6290-7227-8cdb-95cad475a53c', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-629e-7ce5-9846-ca438c28f8da', 'Digits After Decimal for Thousandths', 'Thousandths have three digits after the decimal point.', '019c2804-6290-7227-8cdb-95cad475a53c', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62a0-7048-84b3-e689572acd54', 'Definition of Decimals', 'Numbers expressed in decimal form are called decimal numbers or decimals.', '019c2804-629f-79b6-b857-4b968e3f77b5', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62a1-7e0d-a1bd-05c88f9a074f', 'Examples of Decimals', 'Examples of decimals include 0.7, 1.23, and 3.456.', '019c2804-629f-79b6-b857-4b968e3f77b5', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62a2-7ede-ae50-d3740ee8ec68', 'Place Value System', 'As we move from right to left, the place value of a digit increases by 10 times; as we move from left to right, it decreases by 10 times.', '019c2804-629f-79b6-b857-4b968e3f77b5', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62a3-7f5f-8437-d8cb8a77d821', 'Extending Place Value', 'To the right of the ones digit, the place values are tenths (1/10), hundredths (1/100), and thousandths (1/1000).', '019c2804-629f-79b6-b857-4b968e3f77b5', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62a4-74b5-8f8e-f3e1334cdb9a', 'Place Value Table Example', 'A place value table illustrates the position and value of each digit in a decimal number like 5347.618, including thousands, hundreds, tens, ones, tenths, hundredths, and thousandths.', '019c2804-629f-79b6-b857-4b968e3f77b5', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62a5-7dd9-b4aa-f71fc8c9760c', 'Expanded Form', 'A decimal number can be represented in its expanded form by summing the products of each digit and its place value (e.g., 5347.618 = 5x1000 + 3x100 + 4x10 + 7x1 + 6/10 + 1/100 + 8/1000).', '019c2804-629f-79b6-b857-4b968e3f77b5', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62a6-797e-95dd-456c0ab76616', 'Reading Decimal Numbers', 'A decimal number is read by stating the whole number part, then ''point'', and then the digits in the decimal part (e.g., 5347.618 as ''Five thousand three hundred forty-seven point six one eight'').', '019c2804-629f-79b6-b857-4b968e3f77b5', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62a7-773d-9a1c-c00868d3e660', 'Decimals Without Whole Number Part', 'When a decimal number does not contain any whole number part, we write 0 in the ones place for clarity (e.g., 0.75 instead of .75).', '019c2804-629f-79b6-b857-4b968e3f77b5', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62a8-7a8a-aa06-e8c219ee8811', 'Importance of Zeros in Decimals', 'Zeros are very important within decimal numbers as they hold specific place values (e.g., 7.802 = 7 + 8/10 + 0/100 + 2/1000).', '019c2804-629f-79b6-b857-4b968e3f77b5', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62aa-70ad-b041-77a7012f4265', 'Number Line Construction', 'Draw a line, mark point O as 0, and points A, B, C corresponding to 1, 2, 3 at equal distances; each unit segment (e.g., O to A) is further divided into ten equal parts.', '019c2804-62a9-762a-ada9-d644a447fac0', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62ab-7f19-8947-e8b7e6f29dce', 'Representing 0.6', '0.6 is greater than zero but less than 1; it is represented by the 6th part to the right starting from zero.', '019c2804-62a9-762a-ada9-d644a447fac0', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62ac-764d-828a-6d7d79c5ac3c', 'Representing 1.7', '1.7 is greater than 1 but less than 2; it is represented by the 7th part to the right starting from 1.', '019c2804-62a9-762a-ada9-d644a447fac0', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62ad-7f67-86fc-9473cb4fb1f9', 'Representing 2.8', '2.8 lies between 2 and 3; it is represented by the 8th part to the right starting from 2.', '019c2804-62a9-762a-ada9-d644a447fac0', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62ae-7319-a516-16af9b04182b', 'Identifying Whole Number Range for Decimals', 'To determine between which two whole numbers a decimal lies, locate its position on the number line.', '019c2804-62a9-762a-ada9-d644a447fac0', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62af-75c1-99a8-71ac0f8cdc3e', 'Nearest Whole Number for 0.3', '0.3 lies between 0 and 1, and the whole number 0 is nearer to 0.3.', '019c2804-62a9-762a-ada9-d644a447fac0', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62b0-7af5-ae17-e24c24728301', 'Nearest Whole Number for 6.7', '6.7 lies between 6 and 7, and the whole number 7 is nearer to 6.7.', '019c2804-62a9-762a-ada9-d644a447fac0', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62b1-775c-a3b3-4e23cf50542a', 'Nearest Whole Number for 4.4', '4.4 lies between 4 and 5, and the whole number 4 is nearer to 4.4.', '019c2804-62a9-762a-ada9-d644a447fac0', '5', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62b3-7475-a1ee-e226f53c430a', 'Decimal Places Definition', 'The number of digits contained in the decimal part of a decimal number is called the number of decimal places.', '019c2804-62b2-7935-8bfd-6d520b7a61a6', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62b4-7f3c-832c-f55f656dfb64', 'Examples of Decimal Places', 'For example, 5.76 has two decimal places, 23.458 has three, and 0.95 has two.', '019c2804-62b2-7935-8bfd-6d520b7a61a6', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62b5-7867-a32e-26eaba135c94', 'Like Decimals Definition', 'Decimals with the same number of decimal places are called like decimals.', '019c2804-62b2-7935-8bfd-6d520b7a61a6', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62b6-71aa-95a4-68b6d6991610', 'Examples of Like Decimals', 'For example, 7.39, 4.57, and 23.86 are like decimals, as each has two decimal places.', '019c2804-62b2-7935-8bfd-6d520b7a61a6', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62b7-7841-8b36-b8fd8dbb12be', 'Unlike Decimals Definition', 'Decimals having different numbers of decimal places are called unlike decimals.', '019c2804-62b2-7935-8bfd-6d520b7a61a6', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62b8-74c0-9794-fc6e00cdeab5', 'Examples of Unlike Decimals', 'For example, 0.5 (one decimal place), 3.57 (two), and 4.893 (three) are unlike decimals.', '019c2804-62b2-7935-8bfd-6d520b7a61a6', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62b9-7548-8b00-31cab319e1bd', 'Effect of Zeros on Decimal Value', 'Writing zeros to the extreme right of the decimal part does not change the value of the decimals.', '019c2804-62b2-7935-8bfd-6d520b7a61a6', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62ba-77cc-871a-22b62b01a791', 'Steps to Convert Unlike to Like Decimals', 'Unlike decimals can be converted into like decimals by adding zeros to the right of the decimal part until all decimals have the maximum number of decimal places.', '019c2804-62b2-7935-8bfd-6d520b7a61a6', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62bb-762f-901a-44f07ba94e28', 'Example of Converting to Like Decimals', 'Converting 0.8, 3.25, and 4.387 into like decimals results in 0.800, 3.250, and 4.387 respectively.', '019c2804-62b2-7935-8bfd-6d520b7a61a6', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62bd-71e2-8bca-e3779c05e2db', 'Step 1: Convert to Like Decimals for Comparison', 'Convert all unlike decimals into like decimals.', '019c2804-62bc-752b-834d-69f74d6ad5e1', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62be-71fb-b0ff-6f8a64629bc1', 'Step 2: Compare Whole Number Parts', 'Compare the whole number part; the number with the greater whole number part is greater.', '019c2804-62bc-752b-834d-69f74d6ad5e1', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62bf-73ec-abd5-9b63b50de4b7', 'Step 3: Compare Tenths Place', 'If the whole number parts are equal, compare the digits in the tenths place; the decimal with the greater digit at the tenths place is greater.', '019c2804-62bc-752b-834d-69f74d6ad5e1', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62c0-7ba6-998d-431d7db0c9e9', 'Step 4: Compare Hundredths Place', 'If the digits in the tenths place are also equal, then compare the digits in the hundredths place, and so on.', '019c2804-62bc-752b-834d-69f74d6ad5e1', '7', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62c1-7812-9a3c-537507ce6345', 'Example: Comparing 6.8 and 5.9', 'Since 6 ones is greater than 5 ones, 6.8 is greater than 5.9.', '019c2804-62bc-752b-834d-69f74d6ad5e1', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62c2-7a33-b47a-14dc420afd4f', 'Example: Comparing 2.07 and 2.073', 'Converting to like decimals, 2.070 and 2.073, since 0 thousandths is less than 3 thousandths, 2.073 is greater than 2.07.', '019c2804-62bc-752b-834d-69f74d6ad5e1', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62c3-7ac0-ad7d-a15e787233e1', 'Example: Comparing 24.764 and 24.521', 'Since both have the same whole number part and 7 tenths is greater than 5 tenths, 24.764 is greater than 24.521.', '019c2804-62bc-752b-834d-69f74d6ad5e1', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62c4-7596-a30a-27307768fa75', 'Example: Comparing 2.04 and 2.01', 'Since both have the same whole number and tenths part, and 4 hundredths is greater than 1 hundredth, 2.04 is greater than 2.01.', '019c2804-62bc-752b-834d-69f74d6ad5e1', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62c5-728e-845e-5fe7c224b707', 'Arranging Decimals in Descending Order', 'To arrange decimals in descending order, convert them to like decimals and then order them from largest to smallest based on place values.', '019c2804-62bc-752b-834d-69f74d6ad5e1', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62c7-71a5-afa6-30ce8e21ff2b', 'Step 1: Write Numerator', 'Write the given decimal number without the decimal point as the numerator of the fraction.', '019c2804-62c6-73b0-84b4-13ec731cb1d0', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62c8-70b5-89f7-7c83b101a5ab', 'Step 2: Write Denominator', 'In the denominator, write 1 followed by as many zeros as there are decimal places in the given number.', '019c2804-62c6-73b0-84b4-13ec731cb1d0', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62c9-74eb-9489-d05d514dbc3b', 'Step 3: Reduce Fraction', 'Reduce the resulting fraction into its lowest terms.', '019c2804-62c6-73b0-84b4-13ec731cb1d0', '8', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62ca-758d-ba15-fa2779f74126', 'Example: Convert 6.25', '6.25 can be converted to 625/100, which simplifies to 6 and 1/4.', '019c2804-62c6-73b0-84b4-13ec731cb1d0', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62cb-7ebf-a507-888919f4ce10', 'Example: Convert 0.66', '0.66 can be converted to 66/100, which simplifies to 33/50.', '019c2804-62c6-73b0-84b4-13ec731cb1d0', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62cc-75bb-9dd6-44a1e1ac4b27', 'Example: Convert 0.125', '0.125 can be converted to 125/1000, which simplifies to 1/8.', '019c2804-62c6-73b0-84b4-13ec731cb1d0', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62cd-7605-bd6f-ec64bee3d015', 'Example: Convert 42.25', '42.25 can be converted to 4225/100, which simplifies to 42 and 1/4.', '019c2804-62c6-73b0-84b4-13ec731cb1d0', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62cf-7b84-bd44-8fd9f5d7e4cc', 'Conversion When Denominator is 10, 100, or 1000', 'If the denominator is 10, 100, or 1000, directly write the numerator with the decimal point placed according to the number of zeros in the denominator.', '019c2804-62ce-7857-b650-f9570331cbe0', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62d0-7074-912c-2aa527a08c2a', 'Example: Convert 17/10', '17/10 is converted to 1.7.', '019c2804-62ce-7857-b650-f9570331cbe0', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62d1-7a48-81c1-598a885fa267', 'Example: Convert 245/100', '245/100 is converted to 2.45.', '019c2804-62ce-7857-b650-f9570331cbe0', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62d2-79df-8377-e34fdc417072', 'Example: Convert 3146/1000', '3146/1000 is converted to 3.146.', '019c2804-62ce-7857-b650-f9570331cbe0', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62d3-779f-825e-3059075f5849', 'Example: Convert 16/1000', '16/1000 is converted to 0.016.', '019c2804-62ce-7857-b650-f9570331cbe0', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62d4-7329-ba93-67adf7feac87', 'Equivalent Fraction Method Step 1', 'When the denominator is not 10, 100, or 1000, change the fraction into an equivalent fraction with a denominator of 10, 100, or 1000.', '019c2804-62ce-7857-b650-f9570331cbe0', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62d5-7c86-9c4e-bdcf27833039', 'Equivalent Fraction Method Step 2', 'Count the number of zeros in the denominator (after 1) and put the decimal point in the numerator after as many digits counted from the right as the number of zeros.', '019c2804-62ce-7857-b650-f9570331cbe0', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62d6-761b-9db8-50205df58bc8', 'Example: Convert 5/2 using Equivalent Fraction Method', '5/2 is converted to an equivalent fraction 25/10, which is then written as 2.5.', '019c2804-62ce-7857-b650-f9570331cbe0', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62d7-71f8-b3dc-9bd1f4dec199', 'Example: Convert 17/40 using Equivalent Fraction Method', '17/40 is converted to an equivalent fraction 425/1000, which is then written as 0.425.', '019c2804-62ce-7857-b650-f9570331cbe0', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62d8-7586-ad22-a4b93af9634b', 'Division Method Introduction', 'A fraction can also be changed into a decimal by the division method.', '019c2804-62ce-7857-b650-f9570331cbe0', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62d9-744c-9052-b45fb37064f5', 'Division Method Step 1', 'Divide the numerator by the denominator until a non-zero remainder is left.', '019c2804-62ce-7857-b650-f9570331cbe0', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62da-7eaf-a4fe-392d99afae54', 'Division Method Step 2', 'Put a decimal point in the dividend as well as in the quotient.', '019c2804-62ce-7857-b650-f9570331cbe0', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62db-74b3-862c-82684781a58e', 'Division Method Step 3', 'Put a zero to the right of the decimal point in the dividend.', '019c2804-62ce-7857-b650-f9570331cbe0', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62dc-750f-a02e-e7cadb6fb39c', 'Division Method Step 4', 'Continue division till the remainder is 0.', '019c2804-62ce-7857-b650-f9570331cbe0', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62dd-7e04-9dc8-e2765bf78498', 'Example: Convert 7/4 using Division Method', 'Dividing 7 by 4 gives 1.75.', '019c2804-62ce-7857-b650-f9570331cbe0', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62de-75d4-a441-25103dd86958', 'Example: Convert 37/8 using Division Method', 'Dividing 37 by 8 gives 4.625.', '019c2804-62ce-7857-b650-f9570331cbe0', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62e0-7c20-9891-e2583ffa7e96', 'Money Conversion: Paise to Rupees', '1 paisa is equal to ₹0.01; for example, 50 paise is ₹0.50.', '019c2804-62df-7f3e-b8ed-cbda52e78647', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62e1-763c-a25b-890d52c49ff0', 'Money Example: Rupees and Paise', '15 rupees 50 paise can be written as ₹15.50.', '019c2804-62df-7f3e-b8ed-cbda52e78647', '10', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62e2-771f-b8db-4901f074bb6e', 'Length Conversion: cm to m', '1 cm is equal to 0.01 m.', '019c2804-62df-7f3e-b8ed-cbda52e78647', '11', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
