	('019c2804-62ee-7043-aa0e-f52609608279', 'Weight Example: 62 kg 45 g', '62 kg 45 g is equal to 62.045 kg.', '019c2804-62df-7f3e-b8ed-cbda52e78647', '11', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
