	('019c2804-62f0-782b-813f-89d2ed795814', 'Capacity Conversion: ml to l', '1 ml is equal to 0.001 l.', '019c2804-62df-7f3e-b8ed-cbda52e78647', '12', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62f1-7f4c-808e-a005a725d146', 'Capacity Example: 6 ml', '6 ml is equal to 0.006 l.', '019c2804-62df-7f3e-b8ed-cbda52e78647', '12', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62f2-7ca6-a3be-2621d60c7583', 'Capacity Example: 275 ml', '275 ml is equal to 0.275 l.', '019c2804-62df-7f3e-b8ed-cbda52e78647', '12', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62f3-71fb-b79d-44c4200cdcd4', 'Capacity Example: 8 l 725 ml', '8 l 725 ml is equal to 8.725 l.', '019c2804-62df-7f3e-b8ed-cbda52e78647', '12', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62f4-7aef-8802-1528c3405530', 'Capacity Example: 14 l 50 ml', '14 l 50 ml is equal to 14.050 l.', '019c2804-62df-7f3e-b8ed-cbda52e78647', '12', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62f5-7e89-8f34-07f59c5f4df6', 'Capacity Example: 12 l 5 ml', '12 l 5 ml is equal to 12.005 l.', '019c2804-62df-7f3e-b8ed-cbda52e78647', '12', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62f7-7ac4-a7b0-b8ee6800a224', 'Step 1: Convert to Like Decimals for Addition', 'Convert the given decimals into like decimals.', '019c2804-62f6-7068-82b6-d0a1cfc28301', '12', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62f8-78ed-bae7-fb3785066113', 'Step 2: Align Decimal Points for Addition', 'Write the decimals under one another so that the decimal points are directly underneath each other and digits in each place are aligned.', '019c2804-62f6-7068-82b6-d0a1cfc28301', '12', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62f9-7e59-84fa-8d6f7c036c55', 'Step 3: Add as Whole Numbers', 'Add the numbers as if they were whole numbers.', '019c2804-62f6-7068-82b6-d0a1cfc28301', '12', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62fa-755f-89a1-a6f2f4e5c04c', 'Step 4: Place Decimal Point in Sum', 'Place the decimal point in the sum directly under the aligned decimal points.', '019c2804-62f6-7068-82b6-d0a1cfc28301', '12', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62fb-7751-b31e-4fa817b7c165', 'Example: Sum of Multiple Decimals', 'To find the sum of 6.452 + 315 + 42.32 + 7.5 + 0.15, convert them to like decimals (e.g., 315.000) and add, resulting in 371.422.', '019c2804-62f6-7068-82b6-d0a1cfc28301', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62fc-72dd-aba7-70767711e1f9', 'Real-Life Application: Total Distance', 'Adding distances in kilometers and meters (e.g., Ankit''s travel: 48.340 km + 4.070 km + 0.040 km = 52.450 km).', '019c2804-62f6-7068-82b6-d0a1cfc28301', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62fd-7ba0-be12-4370112e3fe0', 'Real-Life Application: Total Weight', 'Adding weights in kilograms and grams (e.g., Ravi''s purchases: 6.400 kg + 3.050 kg + 12.750 kg = 22.200 kg).', '019c2804-62f6-7068-82b6-d0a1cfc28301', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-62ff-708b-9f36-c907120741e0', 'Subtraction Rule', 'Subtraction of decimals is done by subtracting thousandths from thousandths, hundredths from hundredths, tenths from tenths, ones from ones, and so on.', '019c2804-62fe-7fdb-8f44-c90e74aabf45', '14', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6300-7f7a-b78f-3e35e61f1a0d', 'Example: Subtract 5.17 from 9.234', 'Align decimal points (9.234 - 5.170) and subtract, resulting in 4.064.', '019c2804-62fe-7fdb-8f44-c90e74aabf45', '14', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6301-7152-abe1-985808deaab8', 'Example: Subtract 13.381 from 22.07', 'Align decimal points (22.070 - 13.381) and subtract, resulting in 8.689.', '019c2804-62fe-7fdb-8f44-c90e74aabf45', '14', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6302-73c6-bd8d-621765563765', 'Example: Subtract 5.69 from 16.5', 'Align decimal points (16.50 - 5.69) and subtract, resulting in 10.81.', '019c2804-62fe-7fdb-8f44-c90e74aabf45', '14', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6303-793d-a75d-747b218437ac', 'Example: Subtract 9.842 from 11.6', 'Align decimal points (11.600 - 9.842) and subtract, resulting in 1.758.', '019c2804-62fe-7fdb-8f44-c90e74aabf45', '14', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6304-756b-9adf-b9873373ac48', 'Evaluating Expressions with Mixed Operations', 'Evaluate expressions involving both addition and subtraction of decimals by performing operations in order, aligning decimal points appropriately.', '019c2804-62fe-7fdb-8f44-c90e74aabf45', '14', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6305-7fbc-9399-e92aa4defb89', 'Finding Missing Addend', 'To find what number should be added to a given decimal to get another, subtract the given decimal from the target number (e.g., 92 - 61.5 = 30.5).', '019c2804-62fe-7fdb-8f44-c90e74aabf45', '14', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6306-731e-a1f3-1d24104e5b30', 'Finding Missing Subtrahend', 'To find what number should be subtracted from a given decimal to get another, subtract the target number from the given decimal (e.g., 9.89 - 0.761 = 9.129).', '019c2804-62fe-7fdb-8f44-c90e74aabf45', '14', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6307-7f24-aee8-313de3253486', 'Real-Life Application: Distance by Auto Rickshaw', 'Calculate distance travelled by auto rickshaw by subtracting bus distance from total distance (10.050 km - 7.200 km = 2.850 km).', '019c2804-62fe-7fdb-8f44-c90e74aabf45', '14', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6308-7f03-b048-d9f514f83be5', 'Real-Life Application: Weight of Potatoes', 'Calculate the weight of potatoes by subtracting the combined weight of onions and tomatoes from the total weight of vegetables purchased (10 kg - 4.550 kg = 5.450 kg).', '019c2804-62fe-7fdb-8f44-c90e74aabf45', '15', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61bc-7bf7-bb3a-95107110055e', 'Arithmetic Definition', 'Arithmetic is the branch of mathematics where we study numbers and fundamental operations like addition, subtraction, multiplication, and division.', '019c2804-61bb-7b1c-b7c2-910d9c064574', '117', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61bd-7855-8aef-b26f5c425d94', 'Geometry Definition', 'Geometry is the branch of mathematics where we study shapes.', '019c2804-61bb-7b1c-b7c2-910d9c064574', '117', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61be-74f2-8238-d90e2f4e475a', 'Algebra Definition', 'Algebra is another branch of mathematics in which letters and other general symbols represent numbers and quantities.', '019c2804-61bb-7b1c-b7c2-910d9c064574', '117', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61bf-7378-89d5-bd37673bb2ac', 'Symbol for Unknown', 'A symbol can stand for an unknown number in a mathematical problem.', '019c2804-61bb-7b1c-b7c2-910d9c064574', '117', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61c0-7e81-b735-abb882adfe96', 'Letters for Unknowns', 'Letters of the English alphabet may be used in place of symbols to represent unknown values.', '019c2804-61bb-7b1c-b7c2-910d9c064574', '117', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61c1-71d3-a4f5-60841f767b1f', 'Variables for Multiple Values', 'Symbols and letters representing unknown numbers can have many different numerical values.', '019c2804-61bb-7b1c-b7c2-910d9c064574', '117', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61c3-7239-97c2-13ba51b75a69', 'Matchstick Pattern L', 'Forming the letter L using matchsticks, where one L requires two matchsticks.', '019c2804-61c2-7439-9ba8-c4a03bc30535', '117', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61c4-7d47-b07f-299f8ca14e33', 'Rule for L Pattern', 'The general rule for the number of matchsticks required to form ''n'' Ls is 2 × n or 2n.', '019c2804-61c2-7439-9ba8-c4a03bc30535', '117', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61c5-7913-9b42-4e769faf55e6', 'Matchstick Pattern E', 'Forming the letter E using matchsticks, where one E requires five matchsticks.', '019c2804-61c2-7439-9ba8-c4a03bc30535', '118', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61c6-70d3-a243-72928a5d11a5', 'Rule for E Pattern', 'The general rule for the number of matchsticks required to form ''n'' Es is 5 × n or 5n.', '019c2804-61c2-7439-9ba8-c4a03bc30535', '118', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61c7-7258-975f-c438ebdf8ce8', 'Rule for Even Numbers', 'Any term in the sequence of even numbers (2, 4, 6, 8, ...) can be determined by doubling the term number, given by 2n.', '019c2804-61c2-7439-9ba8-c4a03bc30535', '118', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61c8-7483-80ca-774a7926ee19', 'Rule for Odd Numbers', 'Any term in the sequence of odd numbers (1, 3, 5, 7, ...) can be determined by doubling the term number and then subtracting 1, given by 2n - 1.', '019c2804-61c2-7439-9ba8-c4a03bc30535', '118', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61c9-74d7-a0d6-b0dbefab8c34', 'Sum of First n Odd Numbers', 'The sum of the first ''n'' odd numbers is equal to ''n'' multiplied by ''n'', or n × n.', '019c2804-61c2-7439-9ba8-c4a03bc30535', '119', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61cb-7d0c-b331-c8c269d55c3c', 'Variable Definition', 'A variable is a number which does not have a fixed value and can take any value.', '019c2804-61ca-7ac7-8eb0-305eb31c9a26', '118', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61cc-76c1-8fe2-d00e4887bb08', 'Literal Numbers', 'The letters used to represent numbers are known as literal numbers or simply literals.', '019c2804-61ca-7ac7-8eb0-305eb31c9a26', '118', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61cd-78e9-9310-67e79269aba9', 'Common Literals', 'The letters x, y, z, a, b, c are commonly used to represent literal numbers.', '019c2804-61ca-7ac7-8eb0-305eb31c9a26', '118', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61ce-716b-8450-695e693b7200', 'Constant Definition', 'A symbol having a fixed numerical value is called a constant.', '019c2804-61ca-7ac7-8eb0-305eb31c9a26', '118', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61cf-7987-9464-d47cbab6f280', 'Examples of Constants', '100 is a constant, and the number of corners of a triangle (which is 3) is also a constant.', '019c2804-61ca-7ac7-8eb0-305eb31c9a26', '118', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61d1-7391-9b4a-09b77dea8bbe', 'Literals Obey Rules', 'Literals represent numbers and therefore obey all the rules of addition, subtraction, multiplication, and division.', '019c2804-61d0-7683-a266-699be14873a9', '119', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61d2-70db-81e5-4efe8c0c8978', 'Addition of Literal and Number', 'When a number is added to a literal, the sum is expressed as literal + number, e.g., x + 6.', '019c2804-61d0-7683-a266-699be14873a9', '119', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61d3-704f-bcb1-20ccd779406c', 'Addition of Two Literals', 'When one literal is added to another, the sum is expressed as literal + literal, e.g., x + y.', '019c2804-61d0-7683-a266-699be14873a9', '119', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61d4-7fb6-bb91-506dd801fbc7', 'Commutative Law for Addition', 'The order of addition for literals does not change the sum; x + y = y + x.', '019c2804-61d0-7683-a266-699be14873a9', '119', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61d5-7577-8d47-0a13c10d706c', 'Associative Law for Addition', 'The grouping of literals in addition does not change the sum; (x + y) + z = x + (y + z).', '019c2804-61d0-7683-a266-699be14873a9', '119', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61d6-76b2-986f-216169640ff8', 'Additive Identity', 'Adding zero to a literal does not change its value; x + 0 = 0 + x = x.', '019c2804-61d0-7683-a266-699be14873a9', '119', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61d7-72d0-842a-2263606fc358', 'Subtraction of Literal and Number', 'When a number is subtracted from a literal, it''s written as literal - number, e.g., x - 3.', '019c2804-61d0-7683-a266-699be14873a9', '119', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61d8-7d78-9a65-135968589e0c', 'Subtraction of Two Literals', 'When one literal is subtracted from another, it''s written as literal - literal, e.g., x - y.', '019c2804-61d0-7683-a266-699be14873a9', '119', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61d9-7791-b073-14838a88015e', 'Commutative Law for Subtraction', 'The commutative law does not hold true for subtraction of literals, meaning x - y is generally not equal to y - x.', '019c2804-61d0-7683-a266-699be14873a9', '120', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61da-70da-bad9-3ab2b47a79d8', 'Associative Law for Subtraction', 'The associative law does not hold true for subtraction of literals, meaning (x - y) - z is generally not equal to x - (y - z).', '019c2804-61d0-7683-a266-699be14873a9', '120', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61db-74a3-b04f-4bf2bdf728bd', 'Multiplication of Literal and Number', 'Multiplying a number by a literal is written by placing the number before the literal, e.g., 3 × x = 3x.', '019c2804-61d0-7683-a266-699be14873a9', '120', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61dc-7ec4-9abb-48b199b714cf', 'Product of 1 and Literal', 'The product of 1 and a literal is simply the literal itself, i.e., 1 × x = x.', '019c2804-61d0-7683-a266-699be14873a9', '120', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61dd-71c0-abd6-1a68c3c8c092', 'Product of -1 and Literal', 'The product of -1 and a literal is written as the negative of the literal, i.e., (-1) × x = -x.', '019c2804-61d0-7683-a266-699be14873a9', '120', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61de-7ac4-b498-3ef55cce0b73', 'Multiplication of Two Literals', 'Multiplying two literals is written by placing them side-by-side, e.g., x × y = xy.', '019c2804-61d0-7683-a266-699be14873a9', '120', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61df-7c78-9813-fc00100055df', 'Commutative Law for Multiplication', 'The order of multiplication for literals does not change the product; x × y = y × x (or xy = yx).', '019c2804-61d0-7683-a266-699be14873a9', '120', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61e0-75e0-90c7-2facf76f0b42', 'Associative Law for Multiplication', 'The grouping of literals in multiplication does not change the product; (x × y) × z = x × (y × z) (or (xy)z = x(yz)).', '019c2804-61d0-7683-a266-699be14873a9', '120', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61e1-78f4-90cb-4d4a31c522c9', 'Distributive Law', 'Multiplication distributes over addition: x × (y + z) = (x × y) + (x × z), which is also written as x(y + z) = xy + xz.', '019c2804-61d0-7683-a266-699be14873a9', '120', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61e2-748b-bc0f-8b02a370746a', 'Multiplicative Identity', '1 is the multiplicative identity; multiplying a literal by 1 does not change its value, i.e., 1 × x = x = x × 1.', '019c2804-61d0-7683-a266-699be14873a9', '120', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61e3-7e8e-86b2-c5b615c5dc07', 'Division of Literal by Number', 'Dividing a literal by a number is expressed as a fraction, e.g., x ÷ 5 or x/5.', '019c2804-61d0-7683-a266-699be14873a9', '120', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61e4-74a4-b638-7b79fcc687b6', 'Division of Number by Literal', 'Dividing a number by a literal is expressed as a fraction, e.g., 5 ÷ x or 5/x.', '019c2804-61d0-7683-a266-699be14873a9', '120', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61e5-750e-82d1-467c79d47c78', 'Division of Two Literals', 'Dividing one literal by another is expressed as a fraction, e.g., x ÷ y or x/y.', '019c2804-61d0-7683-a266-699be14873a9', '120', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61e6-70df-9eb5-3201ea8802fc', 'Mathematician Contributions', 'Ancient Indian mathematicians like Aryabhatt, Brahmagupta, Mahavira, and Bhaskara II made significant contributions to algebra, using terms like Beeja and Varna for unknowns.', '019c2804-61d0-7683-a266-699be14873a9', '122', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61e7-74c0-bb90-92e808e7c1e2', 'Algebraic Expression', 'A combination of numbers and literals connected by basic operations is called an algebraic expression.', '019c2804-61d0-7683-a266-699be14873a9', '123', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-61e8-796a-9f75-ce959243b767', 'Numerical Expression', 'A combination of numbers connected by one or more basic operations is called a numerical expression.', '019c2804-61d0-7683-a266-699be14873a9', '123', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5fda-74a3-a32a-3bb5f8fcbffd', 'Comparison by Difference', 'One way of comparing quantities is by taking the difference between them.', '019c2804-5fd9-73fc-80d8-49c932da8ba1', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5fdb-76d7-82a5-3009ffef5319', 'Comparison by Division', 'Comparing two quantities of the same kind by division forms a ratio and often makes better sense than comparison by difference.', '019c2804-5fd9-73fc-80d8-49c932da8ba1', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5fdc-7c1e-8ff2-90c5b5773dc1', 'Definition of Ratio', 'A ratio between two quantities is a number that expresses their numerical relationship.', '019c2804-5fd9-73fc-80d8-49c932da8ba1', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5fdd-739e-af87-9f44279669df', 'Representation of Ratio', 'The ratio of two numbers ''a'' and ''b'' is a/b and is denoted by a : b (read as ''a is to b'').', '019c2804-5fd9-73fc-80d8-49c932da8ba1', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5fde-78d7-a16e-b2e130fab344', 'Terms of a Ratio', 'In the ratio a : b, ''a'' and ''b'' are called the terms of the ratio.', '019c2804-5fd9-73fc-80d8-49c932da8ba1', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5fdf-71af-8a2a-1235d500b8cb', 'Antecedent and Consequent', 'The first term ''a'' in a ratio is known as the antecedent, and the second term ''b'' is known as the consequent.', '019c2804-5fd9-73fc-80d8-49c932da8ba1', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5fe0-7964-8fd4-b4e1db6d500f', 'Unit for Comparison', 'Two quantities can be compared only if they are in the same unit; otherwise, they should be expressed in the same unit before the ratio is taken.', '019c2804-5fd9-73fc-80d8-49c932da8ba1', '2', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5fe1-76f5-bfc8-e1af5e2d648f', 'Order of Ratio Terms', 'The order of the terms in a ratio is important; changing the order can result in a different ratio.', '019c2804-5fd9-73fc-80d8-49c932da8ba1', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5fe2-793e-bde5-dabd5faf1944', 'Ratio as a Number', 'A ratio of two quantities is just a number and has no unit at all.', '019c2804-5fd9-73fc-80d8-49c932da8ba1', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5fe3-75aa-8d44-280ee99663ca', 'Ratio in Simplest Form', 'A ratio a : b is in the simplest form if its antecedent ''a'' and consequent ''b'' have no common factor other than 1.', '019c2804-5fd9-73fc-80d8-49c932da8ba1', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5fe4-75fe-8ce8-2e82b03dacf6', 'Equivalent Ratios', 'Ratios that have the same meaning or represent the same relationship between quantities are called equivalent ratios.', '019c2804-5fd9-73fc-80d8-49c932da8ba1', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5fe5-74d2-92b2-0c89ea0aeec8', 'Forming Equivalent Ratios', 'A ratio does not change when both its terms are multiplied or divided by the same non-zero number.', '019c2804-5fd9-73fc-80d8-49c932da8ba1', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5fe6-7724-ac7e-e527a60e0914', 'Comparison of Ratios Steps', 'To compare two ratios, express them as fractions, find the L.C.M. of denominators, make denominators equal, and then compare the numerators.', '019c2804-5fd9-73fc-80d8-49c932da8ba1', '3', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5fe8-7c82-8250-65314c24f40e', 'Introduction to Proportion', 'When two ratios are equal, they are said to be in proportion, implying the quantities are changing at the same rate.', '019c2804-5fe7-7804-a142-516a1b901a0b', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5fe9-7df4-89e1-7236f80efa74', 'Definition of Proportion', 'A proportion is a statement that two ratios are equal, denoted by the symbol ''='' or ''::''.', '019c2804-5fe7-7804-a142-516a1b901a0b', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5fea-741d-af3d-fac6756211e2', 'Terms of a Proportion', 'In a proportion a : b :: c : d, ''a'', ''b'', ''c'', and ''d'' are called the first, second, third, and fourth terms, respectively.', '019c2804-5fe7-7804-a142-516a1b901a0b', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5feb-7da2-9b87-ad92bed3c3cc', 'Extreme Terms', 'The first and fourth terms of a proportion (a and d in a : b :: c : d) are called the extreme terms or extremes.', '019c2804-5fe7-7804-a142-516a1b901a0b', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5fec-7743-8f10-621f088ee63d', 'Middle Terms', 'The second and third terms of a proportion (b and c in a : b :: c : d) are called the middle terms or means.', '019c2804-5fe7-7804-a142-516a1b901a0b', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5fed-7f13-83b2-3048da774bf1', 'Product of Extremes and Means', 'In a proportion, the product of the extreme terms is always equal to the product of the middle terms (a × d = b × c).', '019c2804-5fe7-7804-a142-516a1b901a0b', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5fee-7fef-a638-3b287587d91a', 'Condition for Proportion', 'Four numbers a, b, c, d are in proportion if and only if the product of the extremes equals the product of the means (ad = bc).', '019c2804-5fe7-7804-a142-516a1b901a0b', '9', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5ff0-7026-9f27-38000a3578ac', 'Definition of Unitary Method', 'The unitary method involves finding the value of a single unit first, and then using that unit value to calculate the value of any required number of units.', '019c2804-5fef-78bf-8916-c5bc867e9af4', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5ff1-7611-b189-0b3ada7ccf66', 'Direct Variation Definition', 'Two quantities are in direct variation if an increase (or decrease) in one quantity leads to a corresponding increase (or decrease) in the other quantity.', '019c2804-5fef-78bf-8916-c5bc867e9af4', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5ff2-779b-ac17-2b882b04f629', 'Direct Variation Relationship', 'In direct variation, more of one quantity means more of the other, and less of one quantity means less of the other.', '019c2804-5fef-78bf-8916-c5bc867e9af4', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5ff3-7bf3-9bad-88f54a7487e1', 'Formula for Value of Given Units', 'Value of given number of articles = Value of one article × Number of articles.', '019c2804-5fef-78bf-8916-c5bc867e9af4', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5ff4-7147-a304-a1ef7c18da54', 'Formula for Value of One Unit', 'Value of one article = (Value of given number of articles) / (Number of articles).', '019c2804-5fef-78bf-8916-c5bc867e9af4', '13', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5ff6-7900-a5b0-7135386f83f7', 'Definition of Golden Ratio', 'The golden ratio is a decimal value of approximately 1.618 that appears often in nature, art, and architecture.', '019c2804-5ff5-7950-80ee-cbfc6d6b129b', '18', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5ff7-7e7c-aee0-6b452cec571b', 'Mathematical Condition for Golden Ratio', 'Two quantities ''a'' and ''b'' (with a > b) are in golden ratio if their ratio (a+b)/b is equal to a/b.', '019c2804-5ff5-7950-80ee-cbfc6d6b129b', '18', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-5ff8-7a0a-be56-fcdcec6620ca', 'Golden Rectangle Properties', 'A golden rectangle is a shape whose side lengths are in a ratio approximately 1 : 1.618, considered aesthetically pleasing.', '019c2804-5ff5-7950-80ee-cbfc6d6b129b', '18', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-603d-7fab-9c48-bc9ff551a2a8', 'Definition of Geometry', 'Geometry is a branch of Mathematics concerned with shapes and space.', '019c2804-603c-7fc5-807b-7ff32e989b53', '147', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-603e-78fa-8d9b-2950979f9c3d', 'Origin of Geometry', 'The word ''Geometry'' is derived from Greek words ''Geo'' (Earth) and ''metron'' (measurement).', '019c2804-603c-7fc5-807b-7ff32e989b53', '147', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6040-74df-9857-a8f39f92f47f', 'Definition of a point', 'A point is a small dot marked by a sharp tip of a pencil on a sheet of paper.', '019c2804-603f-7419-b409-51984b6b2360', '147', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6041-7d50-9769-166d6858d1a4', 'Properties of a point', 'A point determines a location and has neither length nor thickness.', '019c2804-603f-7419-b409-51984b6b2360', '147', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6042-7a72-9461-c8858cc23e26', 'Notation for a point', 'A point is denoted by a single capital letter such as A, B, C.', '019c2804-603f-7419-b409-51984b6b2360', '147', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6043-72c9-af14-859bd5831d60', 'Reading points', 'Points are read as point A, point B, and point C.', '019c2804-603f-7419-b409-51984b6b2360', '147', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6045-7610-82ab-e89cc35fb309', 'Definition of a line', 'A line is a collection of points which can be extended endlessly in both directions.', '019c2804-6044-7e71-9edc-b81f30f7b585', '147', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6046-76db-a68c-600796994d4c', 'Properties of a line (dimensions)', 'A line has neither breadth nor thickness but has only length.', '019c2804-6044-7e71-9edc-b81f30f7b585', '147', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6047-79de-86bf-8222db6abbe9', 'Line determined by two points', 'Two points determine a unique line.', '019c2804-6044-7e71-9edc-b81f30f7b585', '147', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6048-71a8-9c84-cf09f1d06ae1', 'Naming a line by small letter', 'A line can be named by a small letter of the English alphabet, say l.', '019c2804-6044-7e71-9edc-b81f30f7b585', '147', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6049-7e91-90e1-19c8dd7f0ba6', 'Naming a line by two points', 'A line can be named by two points marked on it, for example, Line AB or AB.', '019c2804-6044-7e71-9edc-b81f30f7b585', '147', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-604a-78cc-9d0f-293624abc70b', 'Property: A line has no end points', 'The arrow heads on a line show that it goes on endlessly in both directions, implying no end points.', '019c2804-6044-7e71-9edc-b81f30f7b585', '147', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-604b-7e82-a729-0d1873d68321', 'Property: Only one line through two points', 'Only one line can be drawn through any two given points.', '019c2804-6044-7e71-9edc-b81f30f7b585', '147', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-604c-7735-bc8b-40908b3ce55a', 'Property: Line extends indefinitely', 'A line extends indefinitely in both directions, thus it cannot have a definite length.', '019c2804-6044-7e71-9edc-b81f30f7b585', '147', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-604d-7128-8bdf-0e0040f31ed3', 'Property: Infinitely many points on a line', 'A line has infinitely many points on it.', '019c2804-6044-7e71-9edc-b81f30f7b585', '147', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-604e-7673-b94d-01f1c482e841', 'Property: Infinite lines through a given point', 'Infinite lines can be drawn through a given point.', '019c2804-6044-7e71-9edc-b81f30f7b585', '147', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6050-7ab7-906f-ebaf05ac925f', 'Line segment as shortest path', 'The straight path from A to B is a segment (portion) of a line passing through A and B.', '019c2804-604f-74c3-9a0f-abdcb00262a4', '147', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6051-78c3-b14e-0c094bbd06f8', 'Representation of a line segment', 'A line segment from A to B is represented by AB or BA.', '019c2804-604f-74c3-9a0f-abdcb00262a4', '148', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6052-7e3b-8469-ab8d51f392f4', 'End points of a line segment', 'The points A and B are the end points of the line segment AB.', '019c2804-604f-74c3-9a0f-abdcb00262a4', '148', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6053-784a-91cf-35664528d035', 'Formal definition of a line segment', 'A line segment is a part of a line that is bounded by two distinct end points.', '019c2804-604f-74c3-9a0f-abdcb00262a4', '148', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6054-7e4e-b654-c5b68186f2d9', 'Property: Shortest distance', 'A line segment represents the shortest distance between two points.', '019c2804-604f-74c3-9a0f-abdcb00262a4', '148', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6055-7a48-958d-0fa974d08734', 'Property: Infinitely many points on a line segment', 'There are infinitely many points on a line segment.', '019c2804-604f-74c3-9a0f-abdcb00262a4', '148', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6057-75e6-a2d2-9302f1b4b9f9', 'Definition of a ray', 'A ray is a part of a line which has only one end point and can be extended indefinitely in a direction.', '019c2804-6056-7b87-b9d1-61f27dbeb54b', '148', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6058-7d67-8372-6a5b0d5aef8a', 'Properties of a ray (dimensions)', 'A ray has no breadth or thickness.', '019c2804-6056-7b87-b9d1-61f27dbeb54b', '148', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6059-7683-b3db-dfa4bd407830', 'Naming a ray (initial point A)', 'A ray with initial point A and any point B on it, extending towards B, is named ray AB.', '019c2804-6056-7b87-b9d1-61f27dbeb54b', '148', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-605a-7036-a15f-39a3c03c38ca', 'Naming a ray (initial point B)', 'A ray with initial point B and any point A on it, extending towards A, is named ray BA.', '019c2804-6056-7b87-b9d1-61f27dbeb54b', '148', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-605b-701f-ac87-46607ac433dd', 'Distinction between rays AB and BA', 'Ray AB and ray BA are two different rays.', '019c2804-6056-7b87-b9d1-61f27dbeb54b', '148', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-605c-7878-a094-cd0ac46ca923', 'Property: Infinitely many rays from a point', 'Infinitely many rays can be drawn from a point.', '019c2804-6056-7b87-b9d1-61f27dbeb54b', '148', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-605d-7671-8081-0100691fa326', 'Property: Infinitely many rays passing through a point', 'Infinitely many rays can pass through a point.', '019c2804-6056-7b87-b9d1-61f27dbeb54b', '148', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-605f-77a1-8725-92db31a44f62', 'End points comparison', 'A line has no end point, a line segment has two end points, and a ray has one end point.', '019c2804-605e-7ec9-8e35-7d58683d84b8', '148', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6060-7d08-83a1-93f00be3242d', 'Length comparison', 'A line has no definite length, a line segment has a definite length, and a ray has no definite length.', '019c2804-605e-7ec9-8e35-7d58683d84b8', '148', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6061-7b42-b939-db51afcc5d39', 'Drawing on paper comparison', 'A line and a ray can only be represented on paper, while a line segment of given length can be drawn on paper.', '019c2804-605e-7ec9-8e35-7d58683d84b8', '148', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6063-7620-bf08-b9d9afaf4ca0', 'Introduction to surfaces', 'Every solid has a surface which may be flat or curved, smooth or rough.', '019c2804-6062-7dd8-ae97-bc6787492005', '149', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6064-7973-aadb-1f06cd6da36e', 'Definition of a plane', 'A plane is a flat surface that has length and width but no height.', '019c2804-6062-7dd8-ae97-bc6787492005', '149', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6065-7549-886c-fa7b3a1c416e', 'Property: Infinite extension of a plane', 'A plane extends indefinitely in all directions.', '019c2804-6062-7dd8-ae97-bc6787492005', '149', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6066-71ac-b65f-3157273fe954', 'Representation of a plane', 'Only a portion of a plane is drawn, represented by a rectangle or parallelogram, named after points lying in it.', '019c2804-6062-7dd8-ae97-bc6787492005', '149', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6067-7b2f-bb4e-962f1a6c2a33', 'Examples of portions of a plane', 'Surfaces of a floor, wall, table top, and ceiling of a room are examples of a portion of a plane.', '019c2804-6062-7dd8-ae97-bc6787492005', '149', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6069-7a70-b6c7-b78b3ed62755', 'Definition of incidence properties', 'Incidence properties describe the relationship between points and lines in a plane.', '019c2804-6068-7f64-96d4-4b481045be4e', '149', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-606a-7927-8a2c-8b9d37baabd2', 'Property: Line through two points in a plane', 'Any two points on the same plane can be connected by one and only one line, which lies wholly in the plane.', '019c2804-6068-7f64-96d4-4b481045be4e', '149', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-606b-73a8-83c0-7136566dd265', 'Property: Intersection of two planes', 'Two planes intersect in a line.', '019c2804-6068-7f64-96d4-4b481045be4e', '149', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-606c-7c3a-b955-7d441c6f6ecf', 'Example of intersecting planes', 'Flat surfaces of solid shapes meet each other at edges, which are lines, illustrating plane intersection.', '019c2804-6068-7f64-96d4-4b481045be4e', '149', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-606d-7eac-8987-cfe824e14ddb', 'Possibilities for two lines in a plane', 'If two lines are considered in a plane, they may either cut each other or never cut each other.', '019c2804-6068-7f64-96d4-4b481045be4e', '149', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-606f-7997-8539-4c5c99b68158', 'Definition of intersecting lines', 'Two lines that meet at a point are called intersecting lines.', '019c2804-606e-7dcd-becd-6f74d86010e1', '149', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6070-7075-936c-efec6958103f', 'Definition of point of intersection', 'The point where two intersecting lines meet is called the point of intersection.', '019c2804-606e-7dcd-becd-6f74d86010e1', '149', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6072-7e22-a797-c7418004bfec', 'Definition of concurrent lines', 'Three or more lines in a plane are concurrent if all of them pass through the same point.', '019c2804-6071-7784-9949-36f444b44454', '149', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6073-7075-b081-c18b9c63173e', 'Definition of point of concurrence', 'The common point through which concurrent lines pass is called the point of concurrence.', '019c2804-6071-7784-9949-36f444b44454', '149', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6075-755b-85c7-bc218acac181', 'Definition of parallel lines', 'Lines which never meet, even when they are extended, are known as parallel lines.', '019c2804-6074-7780-8e5b-e71bd16c5c37', '150', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6076-7762-98cd-250c8e05d3de', 'Property: Constant distance between parallel lines', 'The perpendicular distance between two parallel lines remains the same at every point.', '019c2804-6074-7780-8e5b-e71bd16c5c37', '150', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6077-7c9e-8ae7-6a9406541f40', 'Symbolic representation of parallel lines', 'Parallel lines are symbolically represented using the ''||'' symbol, e.g., AB || CD.', '019c2804-6074-7780-8e5b-e71bd16c5c37', '150', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6079-7ddf-ba98-a10afab9f018', 'Definition of collinear points', 'Three or more points in a plane are collinear if they all lie on the same line.', '019c2804-6078-76c8-867e-ba3985a86aaa', '150', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-607a-7cc7-8253-cd370380d656', 'Definition of non-collinear points', 'Points that do not all lie on the same line are called non-collinear.', '019c2804-6078-76c8-867e-ba3985a86aaa', '150', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-607c-770c-bb8a-1131fc72998f', 'Definition of a curve', 'A curve is any drawing (straight or non-straight) done without lifting a pencil from the paper.', '019c2804-607b-7de3-87f4-ba91a7d41a8d', '150', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-607d-7008-9cbf-b5f6bd8ac0fa', 'Definition of a simple curve', 'A simple curve is a curve which does not cut itself.', '019c2804-607b-7de3-87f4-ba91a7d41a8d', '150', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-607f-7d83-bfd0-d0cb426f2ca0', 'Definition of open curves', 'Open curves are simple curves that do not begin and end at the same point.', '019c2804-607e-7c89-801a-d0d6d36bb526', '151', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6080-7517-a463-b65bc66ac9c2', 'Definition of closed curves', 'Closed curves are simple curves that begin and end at the same point.', '019c2804-607e-7c89-801a-d0d6d36bb526', '151', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6082-73bf-8088-93c3e76d777f', 'Parts of a closed curve', 'In a closed curve, there are three parts: interior, boundary, and exterior.', '019c2804-6081-7416-ab35-39c2663a50fa', '151', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6083-79b9-b540-f2411c453ec7', 'Definition of interior of the curve', 'The interior (or, inside) of the curve refers to the points within its boundary.', '019c2804-6081-7416-ab35-39c2663a50fa', '151', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6084-7d8e-9b8e-761f6d119533', 'Definition of boundary of the curve', 'The boundary (or, on the curve) refers to the points that form the curve itself.', '019c2804-6081-7416-ab35-39c2663a50fa', '151', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6085-7a85-8cbb-7503b4b1fb53', 'Definition of exterior of the curve', 'The exterior (or, outside) of the curve refers to the points outside its boundary.', '019c2804-6081-7416-ab35-39c2663a50fa', '151', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6086-7489-b7d9-ca02c4daad93', 'Definition of region of a closed curve', 'The interior of a curve together with its boundary is called its region.', '019c2804-6081-7416-ab35-39c2663a50fa', '151', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6087-748d-88ef-051a913a1ed2', 'Property: Exterior extends indefinitely', 'The exterior of any closed figure can be extended indefinitely in all directions.', '019c2804-6081-7416-ab35-39c2663a50fa', '151', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6089-7fba-a15b-8d92d0cd1f69', 'Definition of polygons', 'Simple closed figures having three or more line segments are called polygons.', '019c2804-6088-7afc-8b82-f829f2a9ca4b', '151', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-608a-7665-8930-6af87cceb93e', 'Definition of sides of a polygon', 'The line segments that form the polygon are known as its sides.', '019c2804-6088-7afc-8b82-f829f2a9ca4b', '151', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-608b-7473-9ee7-36f177c0804e', 'Definition of vertex of a polygon', 'The meeting point of a pair of sides of a polygon is called its vertex.', '019c2804-6088-7afc-8b82-f829f2a9ca4b', '151', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-608c-7c9e-86b7-13b07f1d4404', 'Definition of adjacent sides of a polygon', 'Any two sides with a common end point are called the adjacent sides of the polygon.', '019c2804-6088-7afc-8b82-f829f2a9ca4b', '151', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-608d-7ab8-b7e5-f96cee5d1d12', 'Definition of adjacent vertices of a polygon', 'The end points of the same side of a polygon are called the adjacent vertices.', '019c2804-6088-7afc-8b82-f829f2a9ca4b', '151', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-608e-7335-852f-3d28673b5e09', 'Definition of diagonals of a polygon', 'The line segments that join the opposite vertices of the polygon are called its diagonals.', '019c2804-6088-7afc-8b82-f829f2a9ca4b', '151', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-608f-784f-88fd-8d03f951ffc0', 'Example polygon elements', 'An illustration identifying sides, vertices, adjacent sides, adjacent vertices, and diagonals of polygon ABCDE.', '019c2804-6088-7afc-8b82-f829f2a9ca4b', '151', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6091-72d9-a70f-7a4500692508', 'Definition of linear boundary', 'A figure whose boundary is made up of only straight lines is said to have a linear boundary.', '019c2804-6090-7da4-b49d-f30ba255b5f3', '151', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6092-7c14-bcc0-5d491d23bc34', 'Examples of linear boundary', 'Rectangles and squares are examples of figures with linear boundaries.', '019c2804-6090-7da4-b49d-f30ba255b5f3', '151', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6093-7a0c-b24b-96441baff61c', 'Definition of curvilinear boundary', 'A figure whose boundary is made up of only curved lines is said to have a curvilinear boundary.', '019c2804-6090-7da4-b49d-f30ba255b5f3', '152', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6094-7ee3-b465-110c7eafeca5', 'Examples of curvilinear boundary', 'Ovals and circles are examples of figures with curvilinear boundaries.', '019c2804-6090-7da4-b49d-f30ba255b5f3', '152', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6096-7923-9d7a-648864fe4417', 'Introduction to angles from daily life', 'Angles are formed when corners are made, as seen in objects with two hinged arms or clock hands.', '019c2804-6095-7a6d-9ce0-b425f7aeff0a', '153', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6097-79de-9511-70d7d87e4050', 'Definition of an angle', 'An angle is a figure formed by two rays with a common initial point.', '019c2804-6095-7a6d-9ce0-b425f7aeff0a', '153', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6098-7594-9214-062465094b52', 'Definition of vertex of an angle', 'The common initial point of the rays forming an angle is called the vertex.', '019c2804-6095-7a6d-9ce0-b425f7aeff0a', '153', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-6099-7cc1-8d61-dabcb9ec5404', 'Definition of arms or sides of an angle', 'The rays forming the angle are called its arms or sides.', '019c2804-6095-7a6d-9ce0-b425f7aeff0a', '153', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-609a-7c81-85e1-132672b5aea9', 'Representation of an angle', 'To show an angle, a small curve is used at the vertex.', '019c2804-6095-7a6d-9ce0-b425f7aeff0a', '154', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-609b-745f-b9df-d1223e7ae2ea', 'Notation for angle using rays', 'An angle formed by rays OA and OB is denoted by ∠AOB or ∠BOA.', '019c2804-6095-7a6d-9ce0-b425f7aeff0a', '154', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-609c-7599-9e57-d580f81cc717', 'Symbol for angle', 'The symbol ''∠'' stands for angle.', '019c2804-6095-7a6d-9ce0-b425f7aeff0a', '154', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-609d-7ef0-9bba-feb5aa027bb7', 'Notation for angle using numbers or letters', 'An angle can be named by placing numbers (1, 2, 3) or small letters (x, y, z) near the small curve at the vertex.', '019c2804-6095-7a6d-9ce0-b425f7aeff0a', '154', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-609e-7936-a6ec-f51806c9520e', 'Notation for angle using its vertex', 'An angle can also be named by its vertex, e.g., ∠O.', '019c2804-6095-7a6d-9ce0-b425f7aeff0a', '154', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-609f-79f7-b1d3-32d22392541e', 'Rule for angle notation', 'In specifying an angle, the vertex should always be written in the middle.', '019c2804-6095-7a6d-9ce0-b425f7aeff0a', '154', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60a1-7ce7-b053-d07106aa97c5', 'Division of points by an angle', 'All points in a plane relative to an angle can be divided into three parts: interior, exterior, and on the arms.', '019c2804-60a0-7b9f-b9ea-aaddef423808', '154', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60a2-7ab3-9776-d24adc3269c2', 'Definition of interior of an angle', 'The interior of an angle refers to the points that lie between its two arms.', '019c2804-60a0-7b9f-b9ea-aaddef423808', '154', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60a3-782c-bed7-e5645f077747', 'Definition of exterior of an angle', 'The exterior of an angle refers to the points that lie outside its arms.', '019c2804-60a0-7b9f-b9ea-aaddef423808', '154', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60a4-7ae0-829a-1e63b33fedc5', 'Points lying on the arms of an angle', 'Points like P, G, C, and R in a figure lie on the arms of the angle.', '019c2804-60a0-7b9f-b9ea-aaddef423808', '154', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00'),
	('019c2804-60a5-7a6f-81fe-9d3664e8c8f6', 'Property: Angle separates interior from exterior', 'An angle separates its interior from its exterior.', '019c2804-60a0-7b9f-b9ea-aaddef423808', '154', '2026-02-04 09:38:51.002512+00', '2026-02-04 09:38:51.002512+00')
